INSERT INTO `cpl` (`id_cpl`, `id_aspek`, `cpl`, `sumber`, `id_jurusan`, `kode_cpl`, `total_cpl`) VALUES
(20, 5, 'Mampu menerapkan sikap, perilaku, moral dan etika sebagai umat yang taat\r\nberagama dan menjunjung toleransi.', '', 16, 'CPL A', 174),
(21, 7, 'Mampu berkomunikasi secara ilmiah terkait ide, permasalahan dan solusi\r\ndengan efektif melalui lisan dan tulisan pada komunitas terkait, di lingkup\r\nlokal, nasional, atau internasional.', '', 16, 'CPL B', 0),
(22, 7, 'Mampu berpikir inovatif, kreatif dan kritis.', '', 16, 'CPL C', 0),
(23, 7, 'Mampu menjalankan tugas secara efektif secara individu maupun kerjasama\r\ndalam kelompok multidisiplin.', '', 16, 'CPL D', 0),
(24, 7, 'Mampu mengikuti perkembangan ilmu dan teknologi di bidang Teknik Kimia.', '', 16, 'CPL E', 0),
(25, 6, 'Mampu mengenali kebutuhan dan mengamalkan pembelajaran secara\r\nindependen dan sepanjang hayat pada konteks perubahan teknologi dan\r\nsosial yang luas.', '', 16, 'CPL F', 0),
(26, 8, 'Mampu menerapkan pengetahuan matematika dan pengetahuan dasar\r\ndalam bidang Teknik kimia dan memahami konteks ilmu pengetahuan dan\r\nrekayasa multidisiplin yang lebih luas.', '', 16, 'CPL G', 78.5278),
(27, 8, 'Mampu mengidentifikasi, memformulasi, dan menyelesaikan masalah\r\nkerekayasaan di bidang Teknik Kimia dan memilih serta menerapkan\r\nmetode-metode relevan yang dibangun dari metode analitis, komputasi, dan\r\neksperimental yang telah diakui.', '', 16, 'CPL H', 124.714),
(28, 5, 'njakhaldjasldhsadjsd', '', 17, 'CPLIF001', 0),
(29, 6, 'mkla;sdasdsand kasdsd', '', 17, 'CPLIF002', 0),
(30, 5, 'Mampu menunjukkan sikap menjadi insan yang bertaqwa, bertanggung jawab, mandiri dan bekerjasama, sesuai dengan nilai-nilai bela negara, cinta tanah air, serta kepedulian terhadap masyarakat dan lingkungan', 'Pustaka', 18, 'CPL01', 7.1),
(31, 8, 'Mampu menganalisis dan mengaplikasikan teknik analisis data dengan menggunakan perangkat lunak untuk menyelesaikan permasalahan di bidang analisis data', 'Pustaka', 18, 'CPL02', 23.2518),
(32, 8, 'Mampu merancang, mengintegrasikan, dan mengimplementasikan arsitektur manajemen basis data untuk kebutuhan pemrosesan data berskala besar', 'Pustaka', 18, 'CPL03', 0),
(33, 8, 'Mampu menguasai konsep big data dan mengembangkan model prediktif berbasis kecerdasan buatan dalam menyelesaikan permasalahan di berbagai bidang dan domain keilmuan', 'Pustaka', 18, 'CPL04', 0),
(34, 7, 'Mampu merancang, mengembangkan, dan mengimplementasikan sistem berbasis kecerdasan buatan ke dalam bentuk suatu aplikasi sistem cerdas', 'Pustaka', 18, 'CPL05', 0),
(35, 7, 'Mampu merancang, membangun, dan mengkombinasikan algoritma dan model statistik dalam melakukan identifikasi pola, pengambilan keputusan, dan pembuatan model prediksi berdasarkan data yang diberikan', 'Pustaka', 18, 'CPL06', 0),
(36, 7, 'Mampu merancang, melaksanakan, mengembangkan ilmu pengetahuan, dan mendokumentasikan penelitian ilmiah dalam bidang sains data', 'Pustaka', 18, 'CPL07', 0),
(37, 7, 'Mampu mengkomunikasikan informasi dalam bentuk narasi serta visualisasi dari hasil temuan dan wawasan data', 'Pustaka', 18, 'CPL08', 0),
(38, 6, 'Mampu menguasai konsep matematika, statistika, dan dasar ilmu komputer untuk memperkuat landasan ilmiah keilmuan sains data', 'Pustaka', 18, 'CPL09', 0),
(39, 8, 'Mampu merancang dan melaksanakan penelitian dengan metodologi yang benar\r\nserta menganalisis dan menginterpretasi data dengan tepat.', '', 16, 'CPL I', 0),
(40, 8, 'Mampu memilih dan menggunakan sumber daya, pemilihan peralatan rekayasa dan\r\naplikasi perancangan modern yang sesuai, termasuk melakukan prediksi danpemodelan\r\nproblem rekayasa.', '', 16, 'CPL J', 84.4583),
(41, 8, 'Mampu memahami dampak penyelesaian rekayasa bidang Teknik Kimia dalam\r\nkonteks kesehatan, keselamatan, lingkungan, sosial dan ekonomi.', '', 16, 'CPL K', 77.6667),
(42, 8, 'Mampu merancang suatu sistem, komponen, atau proses sesuai dengan kebutuhan\r\ndalam batasan-batasan realistis termasuk aspek ekonomi, lingkungan, sosial, politik, etika,\r\nkesehatan dan keselamatan, kelayakan produksi dan keberlanjutan menggunakan\r\npertimbangan kemajuan pada bidang rekayasa Teknik Kimia.', '', 16, 'CPL L', 83.0909),
(43, 5, 'asasasa', 'sasas', 19, 'cpl01', 0),
(48, 7, 'Mampu membangun pemrograman, kerangka kerja pengembangan, dan penyebaran (deployment) perangkat lunak berbasis kecerdasan buatan', 'Pustaka', 18, 'CPL10', 0),
(49, 5, 'Mampu memiliki keterampilan interpersonal dan profesional dengan menerapkan nilai-nilai etika dalam profesi sains data', 'Pustaka', 18, 'CPL11', 0),
(50, 5, 'Mampu menunjukkan sikap bertakwa kepada Tuhan Yang Maha Esa, berperan sebagai warga negara yang bangga dan cinta tanah air, memiliki nasionalisme serta rasa tanggungjawab pada negara dan bangsa, bekerja sama dan memiliki kepekaan sosial, Menginternalisasi nilai, norma, dan etika akademik, menginternalisasi semangat kemandirian, kejuangan,dan kewirausahaan.', '', 26, 'CPL-1', 0),
(51, 5, 'Mampu menerapkan pemikiran logis, kritis, sistematif, berkinerja mandiri, serta mengkaji implikasi pengembangan atau implementasi ilmu pengetahuan teknologi yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah. ', '', 26, 'CPL-2', 0),
(52, 6, 'Mampu mengkaji implikasi atau implementasi pengembangan ilmu pengetahuan dan teknologi serta menyusun hasil kajian dalam bentuk tugas akhir yang ditunjukkan melalui kinerja mandiri dan kelompok, bertanggungjawab, serta mengembangkan jejaring untuk mampu mengambil keputusan secara tepat. ', '', 26, 'CPL-3', 0),
(53, 7, 'Menguasai kaidah, perspektif, prinsip dan teknik komunikasi dalam berbagai \r\nruang lingkup komunikasi, yakni komunikasi antarpribadi, komunikasi organisasi, komunikasi massa, komunikasi digital.', '', 26, 'CPL-4', 0),
(54, 8, 'Mampu memahani konsep Public Relations, Jurnalistik media massa, serta komunikasi pemasaran dan periklanan serta perkembangan dan transformasi ke arah digital.', '', 26, 'CPL-5', 0),
(55, 8, 'Menguasai pengetahuan tentang literasi digital, media dan informasi, media critisism serta perkembangan media dan masyarakat.', '', 26, 'CPL-6', 0),
(56, 8, 'Mampu merancang dan melakukan penelitian di bidang komunikasi dengan metode penelitian yang kontemporer.', '', 26, 'CPL-7', 0),
(57, 8, 'Melalui konsentrasi PR, lulusan mampu menguasai perkembangan nilai-nilai kehumasan dan etika humas.', '', 26, 'CPL-8', 0),
(58, 8, 'Mampu merancang konsep dan melaksanakan konsep dan prinsip Public Relations yang professional dalam pekerjaan kehumasan berbasis digital serta mampu mengembangkan ide kreatif dan inovatif.', '', 26, 'CPL-9', 0),
(59, 8, 'Mampu merancang konsep, isi, dan bentuk media kreatif baru yang sesuai dengan perkembangan jaman.', '', 26, 'CPL-10', 0),
(60, 8, 'Melalui konsentrasi Komunikasi Pemasaran, lulusan mampu melaksanakan konsep pemasaran termasuk pemasaran digital yang terus berkembang serta merancang strategi komunikasi pemasaran.', '', 26, 'CPL-11', 0),
(61, 8, 'Mampu memproduksi karya media atau produk komunikasi (video, poster, visualisasi dan editing) dalam bentuk media cetak maupun elektronik.', '', 26, 'CPL-12', 0),
(62, 8, 'Mampu melakukan kajian kritis pada iklan, film dan produk media serta media sosial dan internet.', '', 26, 'CPL-13', 0),
(63, 8, 'Melalui konsentrasi Jurnalistik dan broadcast dan media digital lulusan mampu memahami nilai-nilai jurnalisme dari tataran konseptual hingga kontekstual serta memahami dinamika industri media serta menjunjung tinggi etika \r\njurnalisme.', '', 26, 'CPL-14', 0),
(64, 8, 'Mampu mengembangkan jiwa kewirausahaan dalam bidang industri kreatif \r\ndidukung oleh prinsip-prinsip komunikasi digital.', '', 26, 'CPL-15', 0),
(65, 5, 'Menunjukkan sikap bertakwa kepada Tuhan Yang Maha Esa, menjunjung tinggi nilai-nilai kemanusiaan, kepekaan dan kepedulian sosial, nilai-nilai belanegara, taat hukum dan disiplin dalam kehidupan bermasyarakat dan bernegara.', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-1', 0),
(66, 5, 'Berkontribusi dalam peningkatan mutu kehidupan bermasyarakat, berbangsa, bernegara, dan kemajuan peradaban berdasarkan Pancasila, serta menghargai keanekaragaman budaya, pandangan, agama, dan kepercayaan, serta pendapat atau temuan orisinal orang lain.', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-2', 0),
(67, 5, 'Menunjukkan sikap bertanggungjawab atas pekerjaan di bidang keahliannya secara mandiri maupun kelompok dengan menginternalisasi semangat kemandirian, kejuangan, dan kewirausahaan serta Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega,  sejawat baik di dalam maupun di luar lembaganya ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-3', 0),
(68, 5, 'Menginternalisasikan nilai-nilai integritas, norma, dan etika akademik dan sikap responsive, terpercaya, professional sesuai dengan Global Code of Ethics for Tourism yang berkepribadian Indonesia dalam menjalankan tugasnya ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-4', 0),
(69, 6, 'Menguasai konsep teoretis pariwisata secara mendalam, meliputi: Sistem pariwisata dan fenomena pariwisata; Pembangunan pariwisata berkelanjutan; Sumber daya, infrastruktur, dan daya tarik pariwisata; Tipologi dan perilaku wisatawan;  Siklus hidup pariwisata; Peraturan perundangan kepariwisataan; Antropologi budaya wisatawan; Manajemen operasional (perencanaan, pelaksanaan, pengarahan, pemantauan, evaluasi, dan pengendalian) organisasi layanan jasa dan produk pariwisata; Manajemen SDM, keuangan, logistik organisasi layanan jasa dan produk pariwisata; dan Manajemen pemasaran layanan jasa dan produk pariwisata ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-5', 0),
(70, 6, 'Menguasai konsep dan metode: Analisis kesenjangan kebijakan; Penetapan standar kualitas layanan produk dan jasa pariwisata;  Resiliensi diri pada lingkungan kerja untuk internal organisasi kepariwisataan dan dalam penanganan klien; Penilaian daya Tarik wisata; Dampak pembangunan pariwisata ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-6', 0),
(71, 6, 'Menguasai konsep, prinsip, dan teknik: Pemasaran layanan jasa dan produk pariwisata; Pedagogi budaya dan masyarakat; Komunikasi lisan dan tulisan dalam bahasa Indonesia, minimal satu bahasa internasional atau minimal satu bahasa asing lainnya; Presentasi, negosiasi, dan teknik komunikasi dalam mengomunikasikan ide, kebijakan, alternative solusi dan rekomendasi; Analisis laporan dan rasio keuangan minimal tingkat pengembalian investasi (ROI), nilai bersih sekarang (NPV), nilai bersih yang akan datang (FV) dan tingkat pengembalian investasi (IRR); Layanan prima; dan Keselamatan, kesehatan kerja dan lingkungan (K3L) dalam penyediaan layanan jasa dan produk pariwisata termasuk Bantuan Hidup Dasar ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-7', 0),
(72, 6, 'Menguasai pengetahuan faktual tentang indeks daya saing pariwisata. Menguasai konsep perencanaan pariwisata dengan tetap memperhatikan aspek konservasi dan lingkungan', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-8', 0),
(73, 7, 'Mampu menerapkan pemikiran logis, kritis, sistematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang dituangkan dalam mpu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-9', 0),
(74, 7, 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis informasi dan data serta mampu melakukan proses evaluasi diri ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-10', 0),
(75, 7, 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan, desain atau kritik seni', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-11', 0),
(76, 7, 'Menguasai teknologi informasi dan minimal satu bahasa internasional untuk komunikasi lisan dan tulis dalam konteks pengembangan keilmuan dan implementasi bidang keahlian ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-12', 0),
(77, 8, 'Mampu mengidentifikasi, menganalisis, mengevaluasi dan memberikan rekomendasi perbaikan efektivitas interaksi antar pemangku kepentingan (pemerintah, masyarakat, dunia usaha dan industri) pada aspek kepariwisataan dalam satu destinasi skala tapak dan skala kecil dan menengah, menggunakan metode analisis dampak, analisis kekuatan, kelemahan, peluang, dan ancaman, serta analisis berbasis hirarki dan kinerja.', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-13', 0),
(78, 8, 'Mampu mengidentifikasi dan menganalisis faktor-faktor yang berperan dalam efektivitas implementasi kebijakan kementerian yang membidangi kepariwisataan ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-14', 0),
(79, 8, 'Mampu meningkatkan kinerja organisasi usaha-usaha bidang kepariwisataan pada skala kecil dan menengah, meliputi kemampuan: bidang pelayanan prima, penyedia jasa pariwisata, promosi dan pemasaran, manajemen keuangan, K3L ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-15', 0),
(80, 8, 'Mampu melaksanakan kegiatan konservasi dan edukasi yang sesuai dengan\r\nprinsip-prinsip ekowisata dan pariwisata berkelanjutan untuk mempertahankan kesejahteraan entitas lokal ', 'Dokumen Kurikulum Prodi Pariwisata 2023 - 2028', 28, 'CPL-16', 0),
(81, 5, 'Mampu menunjukkan sikap dan karakter yang mencerminkan: ketakwaan kepada Tuhan Yang Maha Esa, etika dan integritas, berbudi pekerti luhur, peka\r\ndan peduli terhadap masalah sosial dan lingkungan, menghargai perbedaan budaya dan kemajemukan, menjunjung tinggi penegakan hukum,\r\nmendahulukan kepentingan bangsa dan masyarakat luas, melalui kreatifitas dan inovasi, ekselensi, kepemimpinan yang kuat, sinergi, dan potensi lain yang dimiliki untuk mencapai hasil yang maksimal.', 'https://drive.google.com/drive/u/0/home', 30, '1', 0),
(82, 7, 'Mampu mengkaji dan memanfaatkan ilmu pengetahuan dan teknologi dalam rangka mengaplikasikannya pada bidang keahlian tertentu, serta mampu mengambil keputusan secara tepat dari hasil kerja sendiri maupun kerja kelompok dalam bentuk laporan tugas akhir atau bentuk kegiatan pembelajaran lain\r\nyang luarannya setara dengan tugas akhir melalui pemikiran logis, kritis,\r\nsistematis dan inovatif.', '', 30, '2', 0),
(83, 8, 'Mampu mengelola pembelajaran diri sendiri, dan mengembangkan diri\r\nsebagai pribadi pembelajar sepanjang hayat untuk bersaing di tingkat nasional, maupun internasional, dalam rangka berkontribusi nyata untuk menyelesaikan masalah dengan mengimplementasikan teknologi informasi dan komunikasi dan\r\nmemperhatikan prinsip keberlanjutan serta memahami kewirausahaan berbasis teknologi.', '', 30, '3', 0),
(84, 5, 'Bertakwa  kepada Tuhan  Yang  Maha  Esa  dan  \r\nMenjunjung tinggi nilai kemanusiaan dalam menjalankan tugas berdasarkan agama, moral dan etika.\r\n', '', 24, 'CPL-1', 0),
(85, 5, 'S2  Dapat berkontribusi dan berperan  dalam \r\n       peningkatan mutu kehidupan bermasyarakat,    \r\n       berbangsa,   dan   bernegara  berdasarkan Pancasila\r\n', '', 24, 'CPL-2', 0),
(86, 5, 'S3 Menginternalisasi nilai nilai , norma, Etika dan sikap \r\n          professional Dan bertanggung jawab atas pekerjaan \r\n         di bidang organisasi dan bisnis.\r\n', '', 24, 'CPL-3', 0),
(87, 5, 'S4    Menunjukkan  sikap saling  percaya, saling  \r\n        melayani,  dan menjunjung tinggi kesetaraan dalam \r\n        profesi\r\n', '', 24, 'CPL-4', 0),
(88, 7, 'KU1 - Mampu menerapkan pemikiran logis, kritis,  \r\nsistematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahliannya; berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan, desain atau kritik seni', '', 24, 'CPL-5', 0),
(89, 7, 'KU2 - Mampu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi;', '', 24, 'CPL-6', 0),
(90, 7, 'KU3 - Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun di luar lembaganya.', '', 24, 'CPL-7', 0),
(91, 7, 'KU4 - Mampu bertanggung jawab atas pencapaian hasil kerja kelompok maupun mandiri dan melakukan supervisi serta evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di bawah tanggung jawabnya;', '', 24, 'CPL-8', 0),
(92, 7, 'KU5 - Mampu menggunakan bahasa internasional untuk komunikasi lisan dan tertulis', '', 24, 'CPL-9', 0),
(93, 7, 'KU6 - Mampu melakukan pemberdayaan masyarakat di bidang sosial dan ekonomi', '', 24, 'CPL-10', 0),
(94, 8, 'KK1 - Memiliki kemampuan dalam menangkap peluang usaha potensial yang kreatif, inovatif, dan memiliki nilai tambah yang bermanfaat untuk menciptakan lapangan kerja yang berhasil guna bagi masyarakat.', '', 24, 'CPL-11', 0),
(95, 8, 'KK2 - Memiliki kemampuan manajerial dalam team work proses perencanaan,pengelolaan, pengawasan dan pengendalian bidang jasa, perdagangan dan manufaktur', '', 24, 'CPL-12', 0),
(96, 8, 'KK3 - Memiliki kompetensi dalam mengembangkan teknik marketing secara digital dan non digital melalui pengembangan produk, keahlian dalam menentukan harga jual, keahlian dalam mempromosikan produk, keahlian dalam pendistribusian produk,  pengelolaan sumberdaya manusia, analisis finansial serta teknik pengadministrasian.', '', 24, 'CPL-13', 0),
(97, 8, 'KK4 - Mampu merancang dan melaksanakan penelitian untuk menghasilkan alternatif penyelesaian masalah di bidang administrasi bisnis', '', 24, 'CPL-14', 0),
(98, 8, 'KK5 - Mampu melakukan pendampingan melalui proses analisis, evaluasi, dan menafsirkan informasi bisnis kepada klien sampai memiliki kemampuan teknis untuk mengembangkan bisnisnya.', '', 24, 'CPL-15', 0),
(99, 8, 'KK6 - Mampu memanfaatkan teknologi informasi dan mengelola big data dalam kegiatan pengembangan bisnis dan membuat keputusan', '', 24, 'CPL-16', 0),
(100, 6, 'P1 - Menguasai serta memahami pengetahuan konsep-konsep entrepreneur dalam bidang jasa, perdagangan dan manufaktur secara professional dengan berlandaskan jiwa bela negara', '', 24, 'CPL-17', 0),
(101, 6, 'P2 - Menguasai dan memahami teknik perencanaan, pengalokasian, pengawasan  serta pengambilan keputusan strategis dalam pengelolaan organisasi yang beradaptasi dengan perubahan lingkungan serta teknologi ', '', 24, 'CPL-18', 0),
(102, 6, 'P3 - Memiliki kemampuan dalam bidang inti administrasi bisnis khususnya marketing, financial, human resource development, opersioanal baik secara konseptual maupun teknis yang menunjang serta pengetahuan terbaru dalam berbagai bidang yang lebih terspesialisasi dalam administrasi bisnis untuk pengambilan keputusan strategis ', '', 24, 'CPL-19', 0),
(103, 6, 'P4 - Menguasai dan memahami teknik analisis dalam pengembangan ilmu administrasi bisnis secara profesional', '', 24, 'CPL-20', 0),
(104, 6, 'P5 - Memiliki pengetahuan dan pemahaman terkait wawasan kebangsaan dan bela negara', '', 24, 'CPL-21', 0),
(105, 5, 'Bertakwa kepada Tuhan Yang Maha Esa dengan menjunjung tinggi nilai kemanusiaan dalam menjalankan tugas berdasarkan agama, moral, dan etika akademik', 'Lampiran Permendikbud Nomor 3 Tahun 2020 tentang Standar Nasional Pendidikan Tinggi', 29, 'CPL-1', 0),
(106, 5, 'Berperan sebagai warga negara yang bangga dan cinta tanah air, memiliki nasionalisme, menghargaikeanekaragaman budaya, pandangan, agama, dan kepercayaan, serta pendapat atau temuan orisinal orang lain guna meningkatkan mutu kehidupan bermasyarakat, berbangsa, bernegara, dan kemajuan peradaban berdasarkan Pancasila dan hukum yang berlaku', 'Lampiran Permendikbud Nomor 3 Tahun 2020 tentang Standar Nasional Pendidikan Tinggi', 29, 'CPL-2', 0),
