(114, 7, 'Mampu menerapkan pemikiran sistematis, kritis, kreatif, inovatif, dan humanis dalam konteks pengembangan ilmu pengetahuan linguistik.', 'Perpres No. 8 Tahun 2012 tentang KKNI dan Pemenristekdikti No. 44 Tahun 2015 tentang SNPT', 29, 'CPL-10', 0),
(115, 7, 'Mampu mengumpulkan, menganalisis, dan menyajikan hasil analisis linguistik secara benar dalam bentuk artikel ilmiah dan skripsi, lalu mengunggahnya di jurnal cetak atau daring dan laman perpustakaan perguruan tinggi.', 'Perpres No. 8 Tahun 2012 tentang KKNI dan Pemenristekdikti No. 44 Tahun 2015 tentang SNPT', 29, 'CPL-11', 0),
(116, 7, 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah keilmuan linguistik Indonesia serta  mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat, baik di dalam maupun di luar lembaganya.', 'Perpres No. 8 Tahun 2012 tentang KKNI dan Pemenristekdikti No. 44 Tahun 2015 tentang SNPT', 29, 'CPL-12', 0),
(117, 7, 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja yang berada dibawah tanggung jawabnya, dan mampu mengelola pembelajaran secara mandiri dengan mengintegrasikan nilai-nilai bela negara dalam pengembangan dan penerapan ilmu pengetahuan.', 'Perpres No. 8 Tahun 2012 tentang KKNI dan Pemenristekdikti No. 44 Tahun 2015 tentang SNPT', 29, 'CPL-13', 0),
(118, 8, 'Mampu menerapkan teori dan konsep linguistik Indonesia) untuk menganalisis masalah-masalah kebahasan', 'Acuan dari ADOBSI dan FORPROSSI', 29, 'CPL-14', 0),
(119, 8, 'Mampu menerapkan dan mempraktikkan keterampilan linguistik untuk memecahkan permasalahan kebahasan secara praktis.', 'Acuan dari ADOBSI dan FORPROSSI', 29, 'CPL-15', 0),
(120, 8, 'Mampu menghasilkan layanan jasa dan  produk kreatif dalam bidang linguistik.', 'Acuan dari ADOBSI dan FORPROSSI', 29, 'CPL-16', 0),
