(131, 5, 'Menginternalisasi sikap profesionalitas dan integritas', '', 23, 'S-11', 0),
(132, 7, 'Mampu menganalisis interaksi antar aktor dalam governansi publik seperti dalam penyusunan kebijakan dan manajemen pelayanan publik, baik di tingkat lokal maupun nasional, dalam aspek sosial, ekonomi, budaya, politik, dan hankam dengan pendekatan ekonomi politik.', '', 23, 'KU-1', 0),
(133, 7, 'Mampu	mengidentifikasi	kepentingan	publik	dalam	siklus kebijakan publik, baik di tingkat lokal maupun nasional', '', 23, 'KU-2', 0),
(134, 7, 'Mampu menganalisis dan mengevaluasi kebijakan publik dengan menggunakan prinsip-prinsip, metode kuantitatif (a.l. cost benefit analysis, analytical hierarchy process) dan metode kualitatif (a.l. participatory impact analysis, studi kasus) dalam seluruh siklus kebijakan (formulasi, implementasi, dan evaluasi)', '', 23, 'KU-3', 0),
(135, 7, 'Mampu mengkaji regulasi yang relevan dan hasil analisis kebijakan yang berupa catatan kebijakan (policy memo), uraian kebijakan (policy brief), atau kertas kerja kebijakan (policy paper) untuk menghasilkan draf kebijakan', '', 23, 'KU-4', 0),
(136, 7, 'Mampu melakukan sosialisasi produk kebijakan dan menghimbau masyarakat untuk berpartisipasi dalam melaksanakan kebijakan publik minimal dengan menggunakan media sosial', '', 23, 'KU-5', 0),
(137, 7, 'Mampu mengorganisasikan (merencanakan, menyusun anggaran, mengalokasikan sumber daya, melaksanakan, dan evaluasi) kegiatan dalam rangka implementasi kebijakan publik dan peningkatan kinerja pelayanan publik', '', 23, 'KU-6', 0),
(138, 7, 'Mampu menganalisis risiko dan melaksanakan program mitigasi risiko\r\nterhadap implementasi kebijakan\r\n', '', 23, 'KU-7', 0),
(139, 7, 'Mampu	mengusulkan	ide/gagasan	reformasi	kebijakan	dan manajemen pelayanan publik.', '', 23, 'KU-8', 0),
(140, 8, 'Menerapkan pemikiran logis, kritis, sistematis dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang pemperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahliannya', '', 23, 'KK-1', 0),
(141, 8, 'Mampu menunjukkan kinerja mandiri, bermutu, dan terukur;', '', 23, 'KK-2', 0),
(142, 8, 'Mengkaji	implikasi	pengembangan	atau	implementasi	ilmu pengetahuan,\r\nteknologi yang memperhatikan dan menerapkan nilai humaniora sesuai dengan keahliannya berdasarkan kaidah, tata cara dan etika ilmiah untuk menghasilkan solusi atau gagasan;', '', 23, 'KK-3', 0),
(143, 8, 'Menyusun deskripsi saintifik hasil kajian dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi;', '', 23, 'KK-4', 0),
(144, 8, 'Mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis terhadap informasi dan data;', '', 23, 'KK-5', 0),
(145, 8, 'Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun di luar lembaganya;', '', 23, 'KK-6', 0),
(146, 8, 'Mampu bertanggungjawab atas pencapaian hasil kerja kelompok dan melakukan supervisi dan evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di bawah tanggungjawabnya;', '', 23, 'KK-7', 0),
(147, 8, 'Mampu melakukan proses evaluasi diri terhadap kelompok kerja\r\nyang berada dibawah tanggung jawabnya, dan mampu mengelola pembelajaran secara mandiri;', '', 23, 'KK-8', 0),
(148, 8, 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan	kembali	data	untuk	menjamin	kesahihan	dan mencegah plagiasi.', '', 23, 'KK-9', 0),
(149, 6, 'Menguasai konsep   teoritis   administrasi,   organisasi,   birokrasi,\r\nkebijakan publik, pelayanan publik, perilaku organisasi, keuangan negara, reformasi administrasi, dan governansi publik.', '', 23, 'P-1', 0),
(150, 6, 'Menguasai konsep teoritis secara umum ilmu politik dan teori\r\nsosial.', '', 23, 'P-2', 0),
(151, 6, 'Menguasai prinsip-prinsip dan kaidah ekonomi makro, hukum administrasi negara, manjemen risiko, dan etika administrasi publik.', '', 23, 'P-3', 0),
(152, 6, 'Menguasai metode penelitian kualitatif dan kuantitatif, minimal metode survei, penelitian lapangan, studi kasus, studi dokumen, dan penelitian kebijakan', '', 23, 'P-4', 0),
(153, 6, 'Menguasai prinsip-prinsip dan teknik komunikasi persuasif, baik lisan maupun tulisan', '', 23, 'P-5', 0);
