INSERT INTO `cpmk` (`id_cpmk`, `kode_cpmk`, `cpmk`, `id_cpl`, `id_matkul`) VALUES
(21, 'CPMK', 'Pada akhir kuliah TRK I mahasiswa dapat memahami kinetika reaksi homogen, memiliki kemampuan untuk merancang,\r\nmenyusun, dan menentukan kondisi optimum reaktor (batch, mixed flow, plug flow, recycle reaktor) untuk proses reaksi homogen\r\nserta memilih jenis reactor yang baik.', 26, 54),
(22, 'CPMK1', 'Mampu menjelaskan dan memahami teori dasar kinetika reaksi homogen', 26, 54),
(23, 'CPMK2', 'Mampu untuk merancang reaktor batch, mixed flow, plug flow, recycle reactor untuk proses reaksi homogen . ', 27, 54),
(24, 'CPMK3', 'Mampu menentukan kondisi optimum reaktor.', 27, 54),
(25, 'CPMK4', 'Mampu untuk memilih jenis reaktor yang baik.', 27, 54),
(27, 'CPMK J', 'Mampu memilih dan menggunakan sumber daya, pemilihan peralatan rekayasa dan aplikasi perancangan modern\r\nyang sesuai.', 40, 60),
(28, 'CPMK K', 'Mampu memahami dampak penyelesaian rekayasa bidang Teknik Kimia dalam konteks kesehatan, keselamatan, dan lingkungan', 41, 60),
(29, 'CPMK L', 'Mampu merancang suatu bejana bertekanan sesuai dengan kebutuhan dalam batasan-batasan realistis termasuk\r\naspek ekonomi, lingkungan, kesehatan dan keselamatan, kelayakan produksi dan keberlanjutan menggunakan\r\npertimbangan kemajuan pada bidang rekayasa Teknik Kimia.', 42, 60),
(30, 'CPMK 1', 'Mahasiswa Program Studi Sains Data Semester I mampu menjelaskan konsep pengetahuan di\r\nbidang Internet of Things dan komponen pendukungnya untuk menyelesaikan suatu permasalahan\r\nsecara tepat.', 31, 61),
(31, 'CPMK 2', 'Mahasiswa Program Studi Sains Data Semester I mampu mengaplikasikan Internet of Things ke\r\ndalam suatu studi kasus dengan memanfaatkan komponen board, sensor dan tools pendukung\r\nuntuk menyelesaikan permasalahan secara praktis.', 32, 61),
(40, 'CPMK-1', 'Mampu menjadi insan yang bertaqwa, mandiri, bertanggung jawab,  bekerjasama, menghargai keanekaragaman budaya dan memiliki wawasan kebangsaan dengan nilai-nilai bela negara ', 30, 92),
(44, 'CPMK-4', 'Mampu secara kreatif dan inovatif memformulasikan pemecahan masalah dengan memanfaatkan Big Data dan teknologi penyimpanan data terdistribusi berbasis konsep-konsep yang relevan dan dengan memanfaatkan alat-alat desain arsitektur dan implementasi Big Data yang tepat', 36, 92),
(45, 'CPMK-3', 'Mampu mengimplementasikan, membandingkan dan mengintegrasikan keahlian, solusi dan gagasan dalam bentuk deskripsi saintifik', 34, 92),
(46, 'CPMK-2', 'Mampu mengaplikasikan bidang keahliannya dan memanfaatkan ilmu pengetahuan, teknologi, dan/atau seni dalam ruang lingkup Big data dalam penyelesaian masalah serta mampu beradaptasi terhadap situasi yang dihadapi', 32, 92),
(47, 'CPMK 3', 'Mahasiswa Program Studi Sains Data Semester I mampu menyusun dan mendokumentasikan unjuk\r\nkerja ke dalam suatu laporan praktikum secara sistematis.', 34, 61),
(48, 'CPMK 1', 'Menerima dan menghargai keanekaragaman, pendapat, dan temuan orisinil orang lain', 30, 62),
(53, 'CPMK 1', 'Menunjukkan sikap bertanggungjawab atas pekerjaan di bidang keahliannya secara mandiri', 30, 71),
(54, 'CPMK 2', 'Menguasai konsep pengetahuan mengenai transformasi data menjadi informasi, insight dan knowledge menggunakan metode dalam ruang lingkup Statistika Komputasi dan konsep teoritis bagian khusus dalam bidang pengetahuan tersebut secara mendalam, serta mampu memformulasikan penyelesaian masalah prosedural.', 31, 71),
(58, 'CPMK.1', 'Mahasiswa Program Studi Sains Data Semester III mampu memahami konsep persamaan linier, matriks, dan vektor serta mampu menyelesaikan permasalahan terkait dengan tepat dan benar.', 30, 70),
(59, 'CPMK.2', 'Mahasiswa Program Studi Sains Data Semester III mampu memahami konsep Ruang Vektor, Transformasi Linier, Nilai Eigen, dan Vektor Eigen serta mampu menyelesaikan permasalahan terkait dengan tepat dan benar.', 34, 70),
(61, 'CPMK 12', 'Menguasai konsep pengetahuan mengenai transformasi data menjadi informasi, insight dan knowledge menggunakan metode statistic pada Statistika Regresi dan konsep teoritis bagian khusus dalam bidang pengetahuan secara mendalam, serta mampu memformulasikan penyelesaian masalah procedural', 31, 72),
(62, 'CPMK 13', 'Mampu mengaplikasikan bidang keahliannya dan memanfaatkan ilmu pengetahuan, teknologi, dan/atau seni dalam ruang lingkup Statistika Regresi dalam penyelesaian masalah serta mampu beradaptasi terhadap situasi yang dihadapi.', 32, 72),
(63, 'CPMK 19', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil pengumpulan, pengelolaan, dan implementasi Statistika Regresi', 32, 72),
(64, 'CPMK 19', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil pengumpulan, pengelolaan, dan implementasi Statistika Regresi', 36, 72),
(65, 'CPMK1', 'Pada akhir kuliah TRK I mahasiswa dapat memahami kinetika reaksi homogen, memiliki kemampuan untuk merancang,\r\nmenyusun, dan menentukan kondisi optimum reaktor (batch, mixed flow, plug flow, recycle reaktor) untuk proses reaksi homogen\r\nserta memilih jenis reactor yang baik.', 26, 95),
(66, 'CPMK2', 'Mampu menjelaskan dan memahami teori dasar kinetika reaksi homogen', 26, 95),
(67, 'CPMK3', 'Mampu untuk merancang reaktor batch, mixed flow, plug flow, recycle reactor untuk proses reaksi homogen . ', 27, 95),
(69, 'CPMK 9', 'Menunjukkan sikap bertanggungjawab atas pekerjaan di bidang keahliannya secara mandiri', 30, 65),
(70, 'CPMK 13', 'Mampu mengaplikasikan bidang keahliannya dan memanfaatkan ilmu pengetahuan, teknologi,\r\ndan/atau seni dalam ruang lingkup Big data dalam penyelesaian masalah serta mampu beradaptasi\r\nterhadap situasi yang dihadapi', 32, 65),
(71, 'CPMK 15', 'Mampu menerapkan pemikiran logis, kritis, sistematis, dan inovatif dalam konteks pengembangan\r\natau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai\r\nhumaniora yang sesuai dengan bidang keahliannya.', 34, 65),
(72, 'CPMK 19', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis informasi dan data.', 35, 65),
(73, 'CPMK022', 'Kemampuan memformulasikan penyelesaian masalah prosedural terkait algoritma dan pemrograman ke dalam bentuk sekuensial, percabangan, perulangan, struktur data array, dan fungsional.', 31, 67),
(74, 'CPMK031', 'Kemampuan menganalisis dan mendesain terkait algoritma dan pemrograman sekuensial, percabangan, perulangan, struktur data, dan fungsional dengan tepat', 32, 67),
(75, 'CPMK032', 'Kemampuan mengaplikasikan bidang keahliannya dan memanfaatkan ilmu pengetahuan, teknologi, dan/atau seni terkait algoritma dan pemrograman sekuensial, percabangan, perulangan, struktur data, dan fungsional dalam penyelesaian masalah secara sistematis', 32, 67),
(76, 'CPMK033', 'Kemampuan mengevaluasi terkait algoritma dan pemrograman sekuensial, percabangan, perulangan, struktur data, dan fungsional dengan tepat.', 32, 67),
