(120, 'CPMK12', 'Mahasiswa memiliki kemampuan untuk memilih dan mengimplementasikan Sistem Manajemen Basis Data yang sesuai dengan kebutuhan pemrosesan data berskala besar. Capaian ini mencakup: Penguasaan konsep dan teknologi sistem manajemen data serta kemampuan mengimplementasikan dan mengelola sistem manajemen data untuk proyek kecerdasan buatan. \r\nPenguasaan sistem manajemen data dengan mempertimbangkan nilai-nilai etika, termasuk kemampuan merancang, mengimplementasikan, dan mengelola sistem manajemen data dengan  memperhatikan aspek etika, serta memiliki keterampilan dalam memastikan integritas dan keamanan data. ', 38, 373),
