INSERT INTO `deskripsi_mk` (`id_deskripsimk`, `rumpun_mk`, `deskripsi_mk`, `id_matkul`) VALUES
(15, '-', 'Mata kuliah Teknik Reaksi Kimia I (TRK I) membahas tentang teori dasar kinetika reaksi homogen, memperkenalkan jenis-jenis reaktor untuk\r\nproses reaksi homogen, perancangan penyusunan reaktor ganda dan recycle reaktor. Perumusan kinetika, multiple reaksi untuk sistim homogen,\r\nperencanaan reaktor dengan kondisi yang optimum pada reaksi tunggal dan ganda, perancangan reaktor dengan proses adiabatic..', 54),
(16, '-', 'Mahasiswa mampu menganalisa suatu bahan untuk mengetahui unsur atau komponen yang ada di dalam bahan tersebut ( kualitatif ) dan mampu menghitung banyaknya / kadar suatu unsur atau komponen dalam suatu bahan dengan metode\r\ngravimetri dan titrimetri ( kuantitatf )', 58),
(17, '-', 'Big Data adalah', 59),
(18, '-', 'Mata Kuliah ini membahas tentang: Konsep-konsep dasar perancangan bejana bertekanan meliputi bejana bertekanan dalam,\r\ndan bejana bertekanan luar. Perencanagan bejana untuk proses kimia dan bejana tinggi untuk proses pemisahan, dan\r\nKeselamatan dan Keamanan dalam perancanagn (K3).', 60),
(19, 'Arsitektur dan Jaringan Komputer', 'Mata kuliah ini mempelajari konsep Internet of Things yakni suatu cara untuk menghubungkan perangkat elektronik ke internet dan mengontrolnya di berbagai lokasi manapun dan kapanpun tanpa batasan waktu. Mahasiswa diharapkan mampu mengenali perangkat dan komponen elektronik seperti board, transistor, resistor, sensor, dan third-party platform untuk melakukan pengumpulan data, pemantauan dan analisis terhadap objek yang diukur atau dikontrol. Mahasiswa akan diajak untuk menggali ide projek yang berkaitan dengan Internet of Things seperti mengukur kelembapan udara, kelembapan tanah, ketinggian dan jarak suatu objek, dan lainnya yang dapat dipantau melalui analitik dasbor.', 61),
(20, '-', 'qwerty', 87),
(21, 'Data Science', 'Mata kuliah ini mempelajari konsep dasar keilmuan di bidang sains data, proses-proses dalam sains data dan kaitannya dengan ekosistem big data, teknologi pendukung penyimpanan basis data terstruktur tidak terstruktur, dan semi-struktur, model algoritma machine learning serta bagaimana peranan sains data mampu menyelesaikan berbagai latar belakang permasalahan di kehidupan sehari-hari.', 62),
(22, 'Data Engineering', 'Mata kuliah ini mempelajari tentang paradigma, arsitektur dan framework terbaru dalam penyimpanan data dibandingkan teknologi konvensional dalam hal sistem komputasi terdistribusi yang mengedepankan 3V (Volume, Velocity, dan Variety) serta penyimpanan sejumlah data yang besar melalui pemrosesan paralel yang disebut sebagai Big Data. Selain itu, implementasi Big Data dibutuhkan untuk kebutuhan analitik data yang akan bermanfaat untuk knowledge, bisnis, dan pengambilan keputusan', 92),
(23, 'Matematika dan Statistika', 'Matakuliah ini memberikan konsep dasar berfikir matematis dalam menyelesaikan permasalahan-permasalahan mengenai konsep sistem bilangan riil, memahami konsep limit fungsi dan kekontinuan, serta mengaplikasikan bentuk sederhana dari konsep turunan dan integral.', 65),
(24, 'Matematika dan Statistika', 'Statistika Regresi merupakan mata kuliah wajib bagi mahasiswa Program Studi Sains Data UPN \"Veteran\" Jawa Timur. Mata kuliah ini mempelajari mengenai konsep analisis regresi untuk menyelesaikan permasalahan yang berkaitan dengan hubungan antara dua variabel atau lebih yang sering ditemui dalam berbagai aspek kehidupan dan pekerjaan. Alajabar Linier juga menjadi mata kuliah dasar untuk menunjang mata kuliah lain, misalnya Regresi Nonparametrik, Analitik Media Sosial, dan Pemodelan Data Bisns.', 72),
(25, 'Mata Kuliah Wajib Program Studi', 'Aljabar Linier merupakan mata kuliah wajib bagi mahasiswa Program Studi Sains Data UPN \"Veteran\" Jawa Timur. Mata kuliah ini mempelajari mengenai konsep serta operasi pada matriks dan ruang vektor seperti determinan, invers, hasil kali dalam, nilai eigen, dan vektor eigen, yang berguna untuk menyelesaikan permasalahan dalam bidang sains data. Alajabar Linier juga menjadi mata kuliah dasar untuk menunjang mata kuliah lain, misalnya Statistika Regresi, Statistika Komputasi, dan Statistika Multivariat.', 70),
(26, 'Matematika dan Sains Data', 'Mata kuliah ini mempunyai luaran untuk memberikan pemahaman terkait pemrograman pada R atau python. Selain \r\nitu juga pemahaman tentang algoritma dasar komputasi untuk metode statistika. Mata kuliah ini memfokuskan pada \r\nkomputasi sebagai dasar dalam melakukan data analisis, inferensia statistik, dan pengembangan metode-metode \r\nstatistika. Materi disampaikan melalui ceramah interaktif, diskusi, latihan, praktikum, serta permasalahan dunia \r\nnyata.', 71),
(27, 'Matematika dan Statistika', 'Pengantar statistika merupakan mata kuliah dasar yang diajarkan pada mahasiswa Sains Data. Pada matakuliah ini diajarkan bagaimana cara menyajikan data dan mengintepretasikannya sehingga mendapatkan suatu informasi yang berguna. Selain itu mata kuliah ini mengajarkan konsep peluang dan penerapannya di kehidupan sehari-hari. Menjelaskan tentang variabel diskrit, variabel kontinu, dan variabel acak yang mungkin ditemui dikehidupan sehari-hari. Pengujian hipotesis juga didapatkan, yaitu untuk mengetahui perbedaan antar populasi yang ada. Menganalisis hubungan antar 2 variabel atau lebih juga dilakukan yaitu dalam analisis regresi sederhana', 66),
(28, 'Data Engineering', 'Mata kuliah ini mempelajari konsep dasar keilmuan di bidang basis data lanjut, proses pengoperasian basis data dan kaitannya dengan ekosistem big data, serta bagaimana peranan basis data mampu menyelesaikan berbagai latar belakang permasalahan di kehidupan sehari-hari.', 73),
(29, '-', 'teknik reaksi kimia .....', 95),
(30, 'Data Engineering', 'Dalam mata kuliah ini mahasiswa akan mempelajari konsep dasar algoritma, cara menyusun dan menjelaskan algoritma suatu program, menjelaskan simbol  simbol yang digunakan dalam flowchart, menjabarkan algoritma dalam sebuah flowchart dan pseudocode, serta membuat algoritma untuk menyelesaikan masalah pemrograman yang diimplementasikan ke dalam bahasa pemrograman Python.', 67),
(31, 'Matematika dan Statistika', 'Mata kuliah ini memberikan pengetahuan dan konsep dasar matematika untuk menyelesaikan setiap permasalahan melalui pendekatan dan kerangka berpikir matematis. Materi perkuliahan lebih ditekankan pada teknik penyelesaiakan masalah secara terstruktur dan sederhana, serta memberikan gambaran pengaplikasian matematika di bidang sains data. Adapun materi perkuliahan untuk membekali mahasiswa antara lain logika, himpunan, matriks, relasi, fungsi, induksi matematika, algoritma dan bilangan bulat, aljabar booelan, graf, pohon, kompleksitas algoritma, teori Bahasa dan automata, serta penerapan matematika untuk bidang sains data.', 69),
(33, 'BASIC SCIENCE / MATEMATIKA DAN ILMU PENGETAHUAN ALAM', '-Mata kuliah ini mempelajari sistem bilangan riil dan bilangan kompleks, fungsi, deferensial, limit, deret Taylor, deret Mac\r\nLaurin dan integral\r\n', 182),
(34, 'Sains Data', 'ertujuan memberikan mahasiswa pemahaman mendalam mengenai konsep, metodologi, dan teknik terkini dalam domain sains data. Mata kuliah ini mencakup aspek penelitian dalam analisis data, pembelajaran mesin, dan pengolahan informasi besar (big data). Mahasiswa akan diajak untuk mengembangkan keterampilan dalam merancang dan melaksanakan proyek penelitian sains data yang relevan dengan tantangan dan peluang di dunia nyata.', 263),
(35, 'Data Engineering', 'Dalam mata kuliah ini mahasiswa akan mempelajari konsep dasar basis data, lingkungan basis data, mendesain basis data, dan melakukan implementasi basis data untuk digunakan dalam membangun sebuah manajemen data pada aplikasi. Desain basis data yang dipelajari yaitu ERD, normalisasi, dan model data relasional. Selain itu mahasiswa mempelajari bahasa- bahasa Query yang digunakan.', 373),
(36, '-', 'singkat proses kimia yang menimbulkan peluang dilakukannya optimsasi, bagaimana memformulasikan permasalahan optimisasi tersebut dan bagaimana langkah-langkah menyelesaikan permasalahan sehingga diperoleh kondisi yang paling menguntungkan (optimal). Permasalahan optimisasi proses kimia ini meliputi: optimasi fungsi-fungsi tanpa batasan (unconstraint function), pemograman linear, pemograman non-linear, dan pemograman diskrit-campuran pada berbagai area sistem proses kimia. Dibahas juga bagaimana penyelesaiaan komputasinya menggunakan komputer.', 261),
(37, '-', 'Mahasiswa mampu menyelesaikan tentang pemilihan proses dan uraian proses, pembuatan flowsheet dan proses, menghitung neraca massa dan neraca energi', 242),
(38, '-', 'Mata Kuliah ini memberikan wawasan dan pengetahuan tentang system manajemen keamanan pangan berdasarkan pada penerapan ISO22000 dan HACCP', 260),
(39, '-', 'Mata kuliah teknologi membran membahas tentang pengertian dasar teknologi membran, karakteristik dan klasifikasi membran, jenis bahan dan karakteristik mebran, jenis proses membran, aplikasi membran di bidang lingkungan dan energi', 248),
(40, '-', 'Mahasiswa mampu menjelaskan, mengidentifikasi, menganalisis reaksi oksidasi  reduksi dalam sel elektrokimia dan sel elektrolisis. Mahasiswa juga menganalisis potensial pembanding, potensial elektroda standar. Mahasiswa juga menerapkan\r\nsel elektrokimia dan sel elektrolisis.', 251),
(41, '-', 'Teknologi minyak atsiri mempelajari tentang susunan kimia, sumber dan berbagai kegunaan minyak atsiri dari berbagai aspek. Teknologi minyak atsiri juga mempelajari berbagai metode pengambilan minyak atsiri berdasarkan produk minyak atsiri yang baik dari segi kualitas maupun kuantitas, mempelajari pelarut yang diizinkan (yang cocok untuk pengambilan minyak atsiri), serta mempelajari tentang analisis produk minyak atsiri yang standart mutu yang baik pada minyak atsiri.', 249),
(42, '-', 'Mata kuliah ini membahas tentang definisi dan karakteristik material maju hingga potensi dan prospek material maju bagi perkembangan teknologi dunia. Selain itu, mata kuliah ini juga membahas tentang berbagai metode karakterisasi yang umum dipakai untuk mengidentifikasi dan menganalisis material maju. Lebih dari itu, mata kuliah ini juga membahas tentang teknologi material maju terkini beserta aplikasinya bagi kehidupan manusia.', 252),
(43, '-', 'Matakuliah ini mengkaji tentang penggolongan polimer, mekanisme reaksi dan kinetike polimer, polimer adisi ionik dan radikal bebas, polimer konensasi, penentuan massa molekul polimer, kelarutan polimer,  struktur dan stereokimie polimer, reaksi kopolimer, dan implementasi polimer dalam kehidupan sehari-hari dan industri ', 250),
(44, '-', 'Material Berbasis Silika mempelajari sumber dan karakteristik silika, struktur silika, komponen silika, nanomaterial, jenis dan aplikasi material berbasis silika, percobaaan skala laboratorium/studi kasus ', 256),
(45, '-', 'Mata kuliah Teknologi Pupuk Silika-Base dan Struvit mempelajari jenis-jenis unsur hara tanaman, pupuk berbasis silika, pupuk berbasis fosfat, pupuk struvite, proses produksi pupuk dan aplikasi pupuk pada suatu jenis tanaman, praktikum produksi pupuk serta perhitungan kelayakan teknis dan finansial produksi suatu\r\njenis pupuk', 257),
(46, '-', 'Pada akhir kuliah mahasiswa mampu memahami peralatan dalam pabrik kimia sesuai dengan standart yang diinginkan dan mampu menguasai dalam perhitungan proses neraca massa dan dalam alat.', 190),
(47, '-', 'Mahasiswa mampu menjelaskan perkembangan  IPTEK, penggolongan bidang teknologi, serta teknologi dan keung\r\ngulan kompetitif bangsa /perusahaan dan dampaknya pada masalah sosial. ', 229),
(48, '-', 'Mahasiswa mampu menyelesaikan tentang prinsip-prinsip pengendalian dalam sisitim pengontrolan, transformasi laplace, response sistem orde satu dan dua dalam seri dan pararel, sistem pengendalian, controller dan final control elemen, blok diagram, sistem pengontrollan reaktor kimia, fungsi transfer lintas tertutup, responsi transient dari sistem, kestabilan dengan metode ceramah, diskusi, pemberian latihan soal dan tugas.', 196),
(49, '-', 'Mata kuliah ini membahas tentang prospek pemanfaatan biomassa sebagai sumber energi baru dan terbarukan. Lebih lanjut lagi, mata kuliah ini juga membahas teknologi konversi biomassa menjadi energi baru dan terbarukan baik teknologi konvensional hingga teknologi mutakhir. Selanjutnya dilakukan praktek dengan menghubungkan teori  teori dasar terhadap teknologi pengolahan biomassa (proses fermentasi menjadi bioetanol, produksi biodiesel dan biobriket).', 254),
(50, '-', 'Mahasiswa mampu menyelesaikan tentang pemilihan proses dan uraian proses, pembuatan flowsheet dan proses, menghitung neraca massa dan neraca energi', 197),
(51, '-', 'Mata Kuliah ini membahas tentang: Pengelolaan limbah padat, cair dan gas yang sesuai dengan standart pemerintah serta untuk menghasilkan berbagai jenis produk.', 262),
(52, '-', 'Mata kuliah MK3L mempelajarai tentang ruang lingkup, latar belakang, sejarah, tujuan dan manfaat serta klausul-klausul dalam system manajemen mutu ISO 9000, system manajemen K3 ISO 45000 dan system manajemen lingkungan ISO 14000', 258),
(53, 'Basic Science', 'Mata kuliah ini mempelajari integral tertentu, integral rangkap, persamaan linier, deferensial parsial ,persamaan bidang singgung nilai ekstrim fungsi dua peubah bebas dan persamaan deferensial.\r\n', 225),
(54, '-', 'Mahasiswa mampu mengerti konsep dasar pemisahan multi komponen, distilasi multi komponen, perhitungan stage minimum, reflux minimum menggunakan metode perhitungan : FUG, dan Wang and Henke serta lokasi feed stage menggunkan Kirk Bride, menyelesaikan masalah ektraksi multi komponen dengan metode group method, menentukan/menghitung kondisi operasional kolom absorbsi multi komponen', 255),
(55, '-', 'Mata kuliah ini mempelajari tentang Energi konvensional yaitu minyak dan gas bumi. Pada minyak bumi yaitu : Komponen dan komposisi senyawa minyak bumi, Klasifikasi Minyak bumi, Produk-produk hasil pemrosesan minyak bumi, Proses pengilangan minyak bumi : treating ; Proses primer; proses-proses sekunder , teknologi pelumas, Teknologi Perlakuan akhir. Pada Gas Bumi yaitu pemrosesan gas bumi baik untuk gas pipa, gas bumi bertekanan ataupun LNG. Selain itu juga membahas bioenergi yaitu energi baru dan terbarukan. Teknologi produksi energi dari biomass yaitu biodiesel, bioetanol, biogas Serta Panas Bumi\r\nAdapun metode pembelajaran yang dilakukan meliputi: kuliah pengantar; Brainstroming; presentasi dan diskusi kelompok dan tugas berupa studi kasus. Evaluasi meliputi penguasaan materi isaat presentasi dan diskusi, ujian dan quiz tertulis.', 207),
(56, 'Statistika dan Matematika', 'Matakuliah ini memberikan konsep dasar berfikir matematis dalam menyelesaikan permasalahan-permasalahan mengenai konsep sistem bilangan real, bilangan kompleks, memahami konsep limit fungsi dan kekontinuan, serta mengaplikasikan bentuk sederhana dari konsep turunan dan integral.', 374),
(57, '-', 'Mata Kuliah ini membahas tentang tentang mekanisme Perpindahan kalor secara konduksi, konveksi dan radiasi serta merancang peralatan perpindahan\r\nkalor\r\n', 237),
(58, '-', 'Pada akhir pembelajaran diharapkan mahasiswa mampu menjelaskan tentang asam karboksilat, lemak/minyak, \r\namina dan heterosiklis, karbohidrat (Monosakarida, Disakarida, Polisakarida beserta turunannya), asam amino dan \r\nprotein.', 191),
(59, '-', 'Mata kuliah ini membahas tentang : Ruang lingkup perancangan proses, konsep dasar dan hierarchi, pemilihan reaktor, pemilihan alat-alat pemisahan sesuai dengan jenis campuran yaitu campuran heterogen, homogen serta azzeotrop. Variabel proses yaitu pompa dan heat exchanger. Jaringan penukar panas, integrasi kombinasi daya dan panas serta pemilihan utilitas. Dasar-dasar optimisasi proses dan penyelesaiannya menggunakan metode simplek, grafik dan linier programming. Penyelesaian optimisasi proses menggunakan aplikasi software Matlab dan Lindo.', 205),
(60, '-', 'Mata kuliah ini mempelajari karakteristik mineral baik secara fisik maupun kimia, jenis mineral logam, proses pengolahan mineral dari bijih, pemanfaatan mineral di berbagai bidang, dan analisa mineral menggunakan intrumentasi.', 209),
(61, '-', 'Mata Kuliah ini membahas tentang: kehidupan mikroorganisme : bakteri , kapang .Algae,protozoa,system reproduksi, habitat dan peranannya dalam \r\nindustri khususnya mampu menyusun tahap-tahap proses fermentasi dan faktor-faktor yang berpengaruh dalam fermentasi', 239),
(62, '-', 'Mata Kuliah ini membahas tentang: metode numerik dari suatu sistem persamaan, tentang akar-akar persamaan, sistem persamaan linear,analisis regresi, interpolasi, integrasi numerik, persamaan differensial biasa dan persamaan differensial -simultan.\r\n', 188),
(63, 'MK prodi', 'Mata Kuliah ini akan membahas wisata berdasarkan jenis kegiatan wisatanya, baik aspek kesesuaian sumber daya maupun aspek daya dukung pemanfaatannya. Wisata perairan secara umum dibedakan antara wisata pantai atau bahari (perairan laut) dan wisata perairan tawar. Kelompok jenis wisata pantai dan bahari terdiri atas wisata pantai, wisata mangrove, wisata selam, wisata snorkelling, wisata pancing, dan wisata selancar. Sementara kelompok jenis wisata perairan tawar terdiri atas wisata danau atau situ, wisata sungai, dan wisata air terjun.', 308),
(64, 'Kepariwisataan', 'Materi mengenai CBT mengutamakan keberadaan dan sumber daya masyarakat lokal sebagai penggerak dan pelaku utama dalam pembangunan baik dalam pelaksanaan kegiatan pariwisata, pengelolaan maupun perencana pariwisata. Manajemen kepariwisataan oleh masyarakat lokal dan untuk masyarakat local, kebijakan yang bersinergi antara masyarakat dan pemerintah.', 306),
(65, 'Wajib', 'Mata kuliah ini membahas mengenai: pengertian, tujuan dan manfaat konservasi; sejarah konservasi di Indonesia; peraturan perundangan terkait konservasi dan pengelolaan sumberdaya alam; prinsip-prinsip konservasi; etika lingkungan; Pengelolaan dan permasalahan sumberdaya alam yang meliputi jenis, manfaat, isu, pemanfaatan, permasalahan dan prinsip pengelolaan; Konservai dan kearifan lokal; Konservasi dan SDGs; Pendidikan Konservasi; Penerapan prinsip-prinsip konservasi dalam pariwisata; Konservasi Air dan Energi    ', 307),
(66, 'Kompetensi Utama', 'Mata Kuliah ini menjelaskan pengertian-pengertian tentang pengolahan sumber daya manusia dalam suatu organisasi publik. Ia akan belajar bagaimana prinsip-prinsip psikologik digunakan untuk memahami perilaku manusia yang bekerja dalam suatu organisasi publik, dan bagaimana sumber daya itu dikembangkan.', 272);
INSERT INTO `detail_rps` (`id_detailrps`, `minggu`, `id_subcpmk`, `indikator`, `kriteria`, `luring`, `daring`, `materi`, `bobot`, `id_matkul`) VALUES
(14, '1', 30, 'Ketepatan\r\nmenjelaskan\r\nteori dasar\r\nkinetika reaksi\r\nhomogen\r\n', 'Non-test:\r\nMeringkas materi\r\nkuliah\r\nTugas I :\r\nmengerjakan tugas\r\nmandiri tentang\r\nkinetika reaksi\r\nhomogen\r\n', '-Kuliah\r\n-Diskusi kelompok\r\n-Kerja kelompok\r\nTM = 1 mg x 2 sks x 50\r\nBT = 1 mg x 2 sks x 60\r\nBM = 1 mg x 2 sks x 60', '-E-Learning dan diskusi\r\ndalam forum\r\n-Membaca teks dan ppt\r\nhttp://ilmu.upnjatim.ac.id', '-Pengertian Kinetika\r\nreaksi 7eactor7,\r\n-pengaruh konsentrasi\r\npada kec. Reaksi.\r\n-Prediksi kecepatan\r\nreaksi dari teori. ', '5', 54),
(15, '2,3', 31, 'Ketepatan\r\nmerumuskan\r\ndan\r\nmenentukan\r\nkecepatan\r\nreaksi pada\r\n7eactor batch\r\nvolume\r\nkonstan dan\r\nvolume\r\nberubah', 'Non-test:\r\nMeringkas materi\r\nkuliah\r\nTugas 2:\r\nmengerjakan tugas\r\nmandiri :\r\nMenentukan\r\nkecepatan reaksi\r\npada volume\r\nkonstan dan\r\nberubah', '-Kuliah\r\n-Diskusi kelompok\r\n-Kerja kelompok\r\nTM = 2 mg x 2 sks x 50\r\nBT = 2 mg x 2 sks x 60\r\nBM = 2 mg x 2 sks x\r\n60\r\n', '-E-Learning dan diskusi\r\ndalam forum\r\n-Membaca teks dan\r\nppt\r\nhttp://ilmu.upnjatim.a\r\nc.id\r\n', '-Interprestasi data\r\nreaktor batch\r\ndengan volume\r\nkonstan,\r\n-Interprestasi data\r\nreaktor batch\r\ndengan volume\r\nberubah.', '10', 54),
(16, '4,5', 32, 'Ketepatan\r\nmerancang\r\n7 eactor ideal\r\n(batch, plug flow, mixed\r\nflow).', 'Non-test:\r\nMeringkas materi\r\nkuliah\r\nTugas 3:\r\nmengerjakan tugas\r\nmandiri :\r\nMerancang reactor\r\nideal.\r\n', '-Kuliah\r\n-Diskusi kelompok\r\n-Kerja kelompok\r\nTM = 2 mg x 2 sks x 50\r\nBT = 2 mg x 2 sks x 60\r\nBM = 2 mg x 2 sks x 60\r\n', '-E-Learning dan diskusi\r\ndalam forum\r\n-Membaca teks dan\r\nppt\r\nhttp://ilmu.upnjatim.a\r\nc.id', 'Reaktor ideal untuk\r\nreaksi tunggal :\r\npengenalan\r\nperancangan reaktor\r\nbatch ideal, reaktor mixed flow steady\r\nstate dan reaktor\r\nmixed flow steady\r\nstate', '20', 54),
(17, '6,7', 33, 'Ketepatan\r\nmerancang\r\nreaktor yang\r\ndisusun ganda\r\ndan recycle\r\nreaktor untuk\r\nsystem reaksi\r\ntunggal.', 'Non-test:\r\nMeringkas materi\r\nkuliah\r\nTugas 4:\r\nmengerjakan tugas\r\nmandiri :\r\nMerancang\r\nreactor yang\r\ndisusun ganda', '-Kuliah\r\n-Diskusi kelompok\r\n-Kerja kelompok\r\nTM = 2 mg x 2 sks x 50\r\nBT = 2 mg x 2 sks x 60\r\nBM = 2 mg x 2 sks x 60', '-E-Learning dan diskusi\r\ndalam forum\r\n-Membaca teks dan\r\nppt\r\nhttp://ilmu.upnjatim.a\r\nc.id\r\n', '-Perancangan untuk\r\nreaksi-reaksi tunggal .\r\n-Perbandingan ukuran\r\nreaktor tunggal.\r\n-Perencanaan reaktor\r\ndisusun seri dan\r\nParallel serta recycle\r\nreaktor', '15', 54),
