(59, '6-7', 91, '3.1 Ketepatan menjelaskan struktur perulangan pernyataan tunggal serta membuat flowchart/pseudocode dan kode script Python 3.2 Ketepatan menjelaskan struktur perulangan pernyataan bersarang serta membuat flowchart/pseudocode dan kode script Python', 'Kriteria: Rubrik holistik \r\nTeknik non - test :  Flowchart /pseudocode dan kode script Python dengan pada studi kasus struktur perulangan pernyataan tunggal maupun bersarang', ' Kuliah \r\n Diskusi [PB: 2x(2x50)] \r\n Tugas-3: Flowchart/pseudocode dan kode script Python dengan pada studi kasus struktur percabangan tunggal maupun bersarang: \r\na. Deret Bilangan Pangkat Tiga dengan for loop \r\nb. Deret Akar Bilangan dengan while loop \r\nc. Deret Faktorial Bilangan dengan do - while loop \r\nd. Deret Bilangan Ganjil Selain Kelipatan 3 dengan continue \r\ne. Deret Bilangan Ganjil Selain Kelipatan 7 serta 11, dan Bilangan yang ditampilkan <100 dengan continue dan break \r\nf. Menentukan Quarter dari suatu Nama Bulan menggunakan goto \r\ng. Drawing Star Pattern dalam Bentuk Segitiga dengan nested loop\r\n[PT+KM: (2+2)x(2x60)]', ' Kuliah Daring \r\n Diskusi Asinkron \r\nE -learning: ILMU https://ilmu.upnjatim.ac.id/', 'Struktur Perulangan Pernyataan Tunggal: \r\n1. Proses Perulangan Pernyataan Tunggal \r\n2. Perulangan for loop: \r\na. Deret Bilangan 1...5 \r\nb. Deret Bilangan Ganjil dan Genap (Kelipatan 2) \r\nc. Deret Bilangan Menurun \r\n3. Perulangan while loop : \r\na. Deret Bilangan 1...5 \r\nb. Deret Huruf \r\nc. Komparasi Bilangan \r\n4. Perulangan do -while loop : \r\na. Deret Bilangan 1...5 \r\nStruktur Perulangan Pernyataan Bersarang: \r\n1. Proses Perulangan Pernyataan Bersarang \r\n2. Pernyataan Break dan Continue : \r\na. Memeriksa Kecocokan suatu Karakter dalam Suatu Kata \r\nb. Memeriksa Kecocokan Elemen dalam suatu List \r\nc. Membuat Operasi Aritmatika dengan Kondisi if <0 \r\n3. Pernyataan goto : \r\na. Re -input dan Periksa Bilangan Prima \r\nb. Input Limit dari Bilangan Fibonacci \r\nc. Re -input dan Periksa Kecocokan Karakter \r\n4. Pernyataan nested loop: \r\na. Perkalian 2 Bilangan \r\nb. Drawing Star Pattern \r\n[1] hal.: 222 -232 \r\n[4] hal: Chapter 9 1 -16', '10', 67),
(60, '9-10', 87, '5.1 Ketetapan mengidentifikasi permasalahan data pada teori penarikan sampel 5.2 Ketepatan menghitung besaran sampel menggunakan sampling sederhana, sampling sistematik, sampling strata \r\n5.3 Ketepatan memilih sampel menggunakan sampling sederhana, sampling sistematik, dan sampling strata\r\n5.4 Mampu merancang sampling suatu populasi', 'Kriteria: \r\n Penugasan \r\n EAS \r\n Partisipasi (Alur pembelajar an) \r\nTeknik non-test: \r\n Penugasan : Rubrik Holistik (6%) \r\n EAS : Soal-soal mengenai distribusi diskrit dengan distribusi kontinu (Pedoman Penskoran) (5%)\r\n Partisipasi : Presensi kelas (1%)', 'Kuliah \r\n\r\n[TM: 2x(3x50)] \r\n\r\nMP1 : Diskusi \r\nMP2 : Small Grup Discussion \r\n\r\n[BM: 2x(3x60)] \r\n Membaca dan memahami materi di E-Learning Pekan ke-9 dan ke-10 \r\n Tugas-5: Peserta kuliah membentuk suatu kelompok untuk menemukan permasalahan yang akan dirancang samplingnya, dihitung besaran sampel serta memilih sampel berdasarkan metode yang tepat. Outputnya adalah laporan dan PPT yang dipresentasika n di dalam kelas pada pekan selanjutnya \r\n\r\n[PT+KM: (2+2) x(4x60)]', 'Kuliah \r\n\r\n[TM: 2x(3x50)] \r\n\r\nMP1 : Diskusi \r\nMP2 : Small Grup Discussion \r\n\r\n[BM: 2x(3x60)] \r\n Membaca dan memahami materi di E-Learning Pekan ke-9 dan ke-10 \r\n Tugas-5: Peserta kuliah membentuk untuk menemukan permasalahan yang akan dirancang samplingnya, dihitung besaran sampel serta memilih sampel berdasarkan metode yang tepat. Outputnya adalah laporan dan PPT yang dipresentasikan di dalam kelas pada pekan selanjutnya \r\n\r\n[PT+KM: (2+2) x(4x60)] \r\nE-learning: ILMU https://ilmu.upnja tim.ac.id/', 'Materi \r\nPembelajaran: \r\n1. Sampling Sederhana\r\n2. Sampling sistematik\r\n3. Sampling strata\r\nPUSTAKA :[Modul BAB 5]', '12', 66),
(61, '1-2', 95, '1.1 Ketepatan menjelaskan tentang konsep logika matematika\r\n1.2 Ketepatan menjelaskan tentang konsep himpunan\r\n1.3 Ketepatan menjelaskan tentang konsep matriks\r\n1.4 Ketepatan menjelaskan tentang konsep relasi dan fungsi', 'Kriteria: Pedoman Penskoran (Marking Scheme)\r\nTeknik non-test:\r\n Perhitungan matematis dan terstruktur', ' Kuliah\r\n Diskusi [PB: 1x(3x50)]\r\n Tugas-1: \r\nMenyusun ringkasan dalam bentuk materi tentang:\r\na. teori logika, himpunan, matriks, dan fungsi\r\nb. soal logika, himpunan, matriks, dan fungsi\r\nc. pembahasan logika, himpunan, matriks, dan fungsi\r\n\r\n[PT+KM: (1+1)x(3x60)]', ' Kuliah Daring\r\n Diskusi Asinkron\r\nE-learning:\r\nILMU\r\nhttps://ilmu.upnjatim.ac.id/', '1. Logika\r\n Proposisi\r\n Tabel Kebenaran\r\n Operasi Logika\r\n2. Himpunan\r\n Jenis-jenis himpunan\r\n Operasi himpunan\r\n Prinsip Dualitas, inklusi dan ekskulsi\r\n3. Matriks\r\n4. Relasi dan Fungsi', '5', 69),
(63, '3-5', 96, '2.1 Ketepatan dalam memahami konsep induksi matematika\r\n2.2 Ketepatan dalam memahami konsep algoritma dan bilangan bulat\r\n2.3 Ketepatan dalam menggunakan konsep aljabar boolean', 'Kriteria: Pedoman Penskoran (Marking Scheme)\r\nTeknik non-test:\r\n Perhitungan matematis dan terstruktur', ' Kuliah \r\n Diskusi [PB: 2x(3x50)] \r\n Tugas-2:\r\nMenyusun ringkasan dalam bentuk materi tentang:\r\na. teori induksi matematika, algoritma, bilangan bulat dan aljabar boolean\r\nb. soal induksi matematika, algoritma, bilangan bulat dan aljabar boolean\r\nc. pembahasan induksi matematika, algoritma, bilangan bulat dan aljabar boolean\r\n\r\n[PT+KM: (2+2)x(3x60)]', ' Kuliah Daring\r\n Diskusi Asinkron\r\nE-learning:\r\nILMU\r\nhttps://ilmu.upnjatim.ac.id/', '1. Induksi Matematika\r\n2. Algoritma\r\n3. Bilangan Bulat \r\n Bilangan Prima \r\n Kriptografi \r\n Fungsi Hash\r\n4. Aljabar Boolean \r\n Ekspresi Boolean \r\n Hukum dan fungsi aljabar Boolean\r\n Bentuk kanonik\r\n Bentuk baku', '5', 69),
(64, '11-12', 88, '6.1 Ketepatan menghitung pendugaan parameter titik dan interval \r\n6.2 Ketepatan melakukan langkahlangkah pengujian hipotesis \r\n6.3 Mampu menyelesaikan permasalahan pendugaan parameter dan pengujian hipotesis', 'Kriteria: \r\n Penugasan \r\n EAS \r\n Partisipasi (Alur pembelajara n) \r\nTeknik non-test: \r\nPenugasan : Pedoman Penskoran (6%) \r\nEAS : Soal-soal mengenai estimasi parameter dan pengujian hipotesis(Pedoman Penskoran) (6%) \r\nPartisipasi : Presensi kelas (1%)', 'Kuliah \r\n\r\n[TM: 2x(3x50)] \r\n\r\nMP1 : Cooperative Learning \r\nMP2 : Small Grup Discussion \r\n\r\n[BM: 2x(3x60)] \r\n Membaca dan memahami materi di E-Learning Pekan ke-11 dan ke-12 \r\n Tugas-6: Peserta kuliah secara kelompok menyelesaikan soal yang diberikan oleh Dosen mengenai pendugaan parameter dan pengujian hipotesis. Masing-masing kelompok mendapatkan soal yang berbeda-beda, hasilnya dipresentasika n di dalam kelas pada pekan selanjutnya \r\n\r\n[PT 2x(3x60)]', 'Kuliah \r\n\r\n[TM: 2x(3x50)] \r\n\r\nMP1 : Cooperative Learning \r\nMP2 : Small Grup Discussion \r\n\r\n[BM: 2x(3x60)] \r\n Membaca dan memahami materi di E-Learning Pekan ke-11 dan ke-12 \r\n Tugas-6: Peserta kuliah secara kelompok menyelesaikan soal yang diberikan oleh Dosen mengenai pendugaan parameter dan pengujian hipotesis. Masing-masing kelompok mendapatkan soal yang berbeda-beda, hasilnya dipresentasikan di dalam kelas pada pekan selanjutnya \r\n\r\n[PT 2x(3x60)] \r\nE-learning: ILMU https://ilmu.upnja tim.ac.id/', 'Materi Pembelajaran: \r\n Pendugaan Parameter Titik: \r\n Populasi Mean \r\n Populasi varians \r\n Populasi proporsi \r\n Pendugaan Parameter Interval: \r\n Populasi Mean ketika  diketahui \r\n Populasi Mean ketika tidak diketahui \r\n Pengujian Hipotesis: \r\n Satu populasi \r\n Dua populasi1', '13', 66),
(66, '6-7', 97, '3.1 Ketepatan dalam memahami konsep graf\r\n3.2 Ketepatan dalam memahami konsep pohon', 'Kriteria: Pedoman Penskoran (Marking Scheme)\r\nTeknik non-test:\r\n Perhitungan turunan secara matematis dan terstruktur', ' Kuliah \r\n Diskusi [PB: 2x(3x50)] \r\n Tugas-3:\r\nMenyusun ringkasan dalam bentuk materi tentang:\r\na. teori graf dan pohon\r\nb. soal graf dan pohon\r\nc. pembahasan graf dan pohon\r\n\r\n[PT+KM: (2+2)x(3x60)]', ' Kuliah Daring\r\n Diskusi Asinkron\r\nE-learning:\r\nILMU\r\nhttps://ilmu.upnjatim.ac.id/', '1. Graf \r\n Konsep graf \r\n Jenis graf \r\n Aplikasi graf\r\n2. Pohon \r\n Konsep pohon \r\n Jenis pohon\r\n Aplikasi pohon', '10', 69),
(67, '9-11', 92, '4.1 Ketepatan menjelaskan konsep struktur data array berdimensi 1 serta membuat flowchart/pseudocode dan kode script Python \r\n4.2 Ketepatan menjelaskan konsep struktur data array berdimensi 2 serta membuat flowchart/pseudocode dan kode script Python \r\n4.3 Ketepatan menjelaskan konsep struktur data array multidimensi serta membuat flowchart/pseudocode dan kode script Python', 'Kriteria: Rubrik holistik \r\nTeknik non- test: Flowchart /pseudocode dan kode script Python dengan pada studi kasus struktur data array berdimensi 1, 2, dan multidimensi', ' Kuliah \r\n Diskusi [PB: 2x(2x50)] \r\n Tugas-4: Flowchart/pseudocode dan kode script Python dengan pada studi kasus struktur data array berdimensi 1, 2, dan multidimensi: \r\na. Memeriksa nilai maksimum dan nilai minimum dari suatu deret dengan array berdimensi 1 \r\nb. Mengurutkan deret angka secara ascending dan descending dengan array berdimensi 1\r\nc. Input mata kuliah dan jumlah jam untuk menghitung Indeks Prestasi semester dengan array berdimensi 2 \r\nd. Membuat input karakter dengan ukuran tertentu dengan array berdimensi 2 \r\ne. Input elemen array berdimensi 3 \r\n[PT+KM: (2+2) x(2x60)]', ' Kuliah Daring \r\n Diskusi Asinkron \r\nE-learning: ILMU https://ilmu.upnjatim.ac.id/', 'Struktur Array Berdimensi 1: \r\n1. Konsep array dan list \r\na. Tipe Elemen \r\nb. Operasi Aritmatika \r\nc. Operasi CRUD \r\n2. Array Berdimensi 1:\r\na. Konsep array berdimensi 1 \r\nb. Menghitung rata-rata tanpa loop \r\nc. Menghitung rata-rata dengan loop tanpa list/array \r\nd. Menghitung rata-rata dengan loop dan list/array \r\ne. Menentukan jumlah hari dari suatu bulan \r\nf. Memeriksa inputan suatu karakter yang memiliki kesamaan dengan karakter dari suatu list/array \r\ng. Mengkategorikan bilangan positif dan negatif\r\nStruktur Array Berdimensi 2: \r\n1. Array Berdimensi 2: \r\na. Konsep array berdimensi 2 \r\nb. Menjumlahkan 2 buah matriks berdimensi 2 \r\nc. Mencari data kelulusan program training berdimensi 2 \r\nd. Membentuk karakter A dengan ukuran matriks tertentu berdimensi 2 \r\nStruktur Array Multidimensi: \r\n1. Array Multidimensi: \r\na. Konsep array multidimensi \r\nb. Menjumlahkan 2 buah matriks berdimensi 3 \r\nc. Mencari data kelulusan berdimensi 3 \r\nd. Membentuk karakter A dan B dengan ukuran matriks tertentu berdimensi 3 \r\n2. Array Dinamis: \r\na. Konsep array dinamis \r\nb. Array Dinamis berdimensi 2 menggunakan list method \r\n3. Passing Array as Function Parameter: \r\na. Konsep parameter fungsi \r\nb. Parameter formal dan aktual \r\nc. Menampilkan elemen pada list/array bertipe string \r\nd. Menampilkan elemen pada list/array menggunakan tuple() \r\ne. Menampilkan elemen pada list/array menggunakan *operator \r\nf. Operasi aritmatika pada list/array berdimensi-2 \r\n[1] hal.: 222-232 \r\n[4] hal: Chapter 9 1-16', '10', 67),
(68, '2', 53, 'Secara lancar\r\ndan terampil\r\ndalam\r\nmempraktikkan\r\npengoperasian\r\nperangkat lunak\r\nESPlorer IDE\r\ndan\r\nmenghubungkan dengan\r\nperangkat keras\r\nboard', 'Mahasiswa\r\nmembuat\r\ndokumentasi\r\nkegiatan praktik\r\npembuatan\r\nprogram\r\nsederhana\r\nmenggunakan\r\nperangkat lunak ESPlorer dan\r\npustaka pilihan\r\nserta\r\nmenghubungkan\r\ndengan perangkat\r\nkeras board', 'Ceramah\r\nPraktik\r\nDiskusi', 'Elearning/\r\nGoogle\r\nmeet/\r\nZoom/\r\nYoutube/\r\nPlatform\r\nMessaging', 'Esplorer IDE\r\n1. Kelengkapan Kebutuhan\r\n2. Download ESPlorer\r\n3. Fitur ESPlorer\r\n4. Tampilan Menu ESPlorer\r\n5. Cara Menghubungkan\r\nESPlorer dengan Board\r\n6. Ujioba Program Hello\r\nMembuat Program\r\nSederhana\r\n7. Membuat LED Blink\r\n8. Penjelasan Program\r\n9. Menjalankan Program\r\n10.Menyimpan Program ke\r\nDisk\r\n11.Menyimpan Program ke\r\nESP\r\n12.Melihat File yang\r\ntersimpan di ESP\r\n13.Menghapus Script di ESP', '5', 61),
(70, '13-15', 89, '7.1 Kompleks dalam mencari permasalahan yang akan dicari kesimpulan (insight) dengan metode statistik yang telah dipelajari \r\n7.2 Mampu mendapatkan data baik sekunder maupun primer \r\n7.3 Mampu menganalisis data hingga mendapatkan kesimpulan yang sesuai \r\n7.4 Mampu membuat laporan dan mempresentasikan proses analisis data yang telah dilakukan', 'Kriteria: \r\n Penulisan Laporan \r\n Presentasi \r\n Partisipasi (Alur pembelajaran) \r\n\r\nTeknik non-test: \r\nPenulisan Laporan: (15%) \r\n Kekompleksan permasalahan \r\n Ketepatan dalam mendapatkan data \r\n Ketepatan dalam melakukan analisis data \r\n Sesuai Format yang ditentukan \r\n Kerapian \r\n Maksimum plagiasi 20% \r\nPresentasi:\r\n Penguasaan materi presentasi \r\n Ketegasan dan ketepatan dalam menjawab pertanyaan \r\n Ketepatan membuat bahan materi dalam ppt (Perspesi) (7%) \r\nPartisipasi : Presensi kelas (3%)', 'Kuliah \r\n\r\n[TM: 3x(3x50)] \r\n\r\nMP1 : Diskusi (mencari permasalahan dan mendapatkan data primer atau sekuder) \r\nMP2 : Diskusi dan konsultasi (melaporkan hasil analisis data) MP3 : Small Grup Discussion \r\n\r\n[BM: 3x(3x60)] \r\n Minggu 1: Mengolah dan menganalisis secara mandiri \r\n Minggu 2: Membuat Laporan dan PPT \r\n Tugas-7: Peserta kuliah secara kelompok mencari permasalahan, mencari data yang akan digunakan, mengolah dan menganalisis data, serta memberikan kesimpulan yang sesuai. Output yang dihasilkan setiap kelompok adalah Laporan dan PPT yang dipresentasikan pada minggu ke-3. \r\n\r\n[PT 3x(3x60)]', 'Kuliah \r\n\r\n[TM: 3x(3x50)] \r\n\r\nMP1 : Diskusi (mencari permasalahan dan mendapatkan data primer atau sekuder) \r\nMP2 : Diskusi dan konsultasi (melaporkan hasil analisis data) MP3 : Small Grup Discussion \r\n\r\n[BM: 3x(3x60)] \r\n Minggu 1: Mengolah dan menganalisis secara mandiri \r\n Minggu 2: Membuat Laporan dan PPT \r\n Tugas-7: Peserta kuliah secara kelompok mencari permasalahan mencari data yang akan digunakan, mengolah dan menganalisis data, serta memberikan kesimpulan yang sesuai. Output yang dihasilkan setiap kelompok adalah Laporan dan PPT yang dipresentasikan pada minggu ke-3. \r\n\r\n[PT 3x(3x60)] \r\nE-learning: ILMU https://ilmu.upnjati m.ac.id/', 'Materi Pembelajaran: \r\n Menentukan topik permasalahan yang akan dianalisis \r\n Menentukan data yang akan digunakan (sekunder atau pun primer) \r\n Mengolah dan menganalisis data yang digunakan \r\n Membuat kesimpulan terhadap hasil analisis', '25', 66);
INSERT INTO `detail_rps` (`id_detailrps`, `minggu`, `id_subcpmk`, `indikator`, `kriteria`, `luring`, `daring`, `materi`, `bobot`, `id_matkul`) VALUES
(72, '12-13', 93, '5.1 Ketepatan menjelaskan konsep fungsi dasar serta membuat flowchart/pseudo code dan kode script Python \r\n5.2 Ketepatan menjelaskan konsep fungsi rekursif serta membuat flowchart/pseudo code dan kode script Python', 'Kriteria: Rubrik holistik \r\nTeknik non - test : Flowchart /pseudoco de dan kode script Python dengan pada studi kasus fungsi dasar dan fungsi rekursif', ' Kuliah \r\n Diskusi [PB: 2x(2x50)] \r\n Tugas-5: Flowchart/pseudocode dan kode script Python dengan pada studi kasus konsep fungsi dasar dan rekursif: \r\na. Membuat konversi suhu celcius ke reamur, kelvin, dan fahrenheit menggunakan function \r\nb. Penggunaan function (sqrt, exp, log, log10, cos, pow, degrees, radians, fabs ) pada pustaka math \r\nc. Penggunaan function randrange pada pustaka random untuk acak dadu dan memberikan reward pada dadu kembar \r\nd. Pembuktian faktorial dari 0!=1 \r\ne. Pembuktian 1%2 = 1 \r\n[PT+KM: (2+2) x(2x60)]', ' Kuliah Daring \r\n Diskusi Asinkron \r\n E - learning: ILMU https://ilmu.upnjatim.ac.id/', 'Fungsi Dasar : \r\n1. Definisi dan tujuan fungsi \r\n2. Parameter fungsi dan nilai kembalian \r\na. Konsep parameter dan nilai kembalian \r\nb. Menjumlahkan 2 bilangan \r\nc. Menentukan bilangan terkecil \r\nd. Menukar posisi 2 bilangan \r\ne. Menampilkan berbagai tipe nilai inputan \r\nf. Memanggil fungsi ke dalam fungsi lainnya \r\n3. Fungsi de ngan built -in Python library \r\na. Konsep library bawaan Python \r\nb. Menghitung akar suatu bilangan menggunakan `sqrt` function \r\nc. Menghitung berapa lama user memasukkan karakter menggunakan `clock` function \r\nd. Countdown menggunakan`sleep` function \r\ne. Simple Random menggunakan `randrange`, `seed` function \r\nf. Simulasi acak dadu menggunakan `randrange` \r\nFungsi Rekursif: \r\n1. Definisi dan karakteristik rekursif \r\n2. Kelebihan dan kekurangan rekursi \r\n3. Konsep rekursi \r\n4. Membuat bilangan faktorial non-rekursif dan dengan rekursif \r\n5. Membuat bilangan berpangkat dengan rekursif \r\n6. Membuat deret Fibonacci dengan rekursif \r\n7. Membalikkan string dengan rekursif \r\n8. Membuat konversi bilangan desimal ke bilangan biner, oktal, hexadecimal dengan rekursif \r\n9. Membuat triangular numbers dengan rekursif \r\n[1] hal.: 222-232 \r\n[4] hal: Chapter 9 1-16', '10', 67),
