(266, '1', 192, '- Ketepatan dalam menjelaskan tentang permulaan perkembangan industri minyak atsiri\r\n- Ketepatan dalam menjelaskan tentang produksi minyak atsiri\r\n- Ketepatan dalam menjelaskan prinsip umum produksi minyak atsiri', 'Kriteria:\r\nRubrik deskriptif\r\nBentuk:\r\n- Non-Test:\r\n- Diskusi Kelompok\r\n- Tugas Kelompok', ' Kuliah\r\n Diskusi Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 1:\r\nbelajar mandiri\r\nPerkembangan minyak atsiri, prinsip umum produksi minyak atsiri\r\n[PT+BM:(1+1)x(2x60)]', ' Chatting dan diskusi pada forum e-Learning : http://ilmu.upnjatim.ac.id\r\n Chatting dan diskusi pada WhatsApp\r\n Membaca text dan media pembelajaran ppt, http://ilmu.upnjatim.ac.id', ' Kontrak Kuliah\r\n Pendahuluan\r\n Produksi minyak atsiri\r\n Prinsip umum produksi minyak atsiri', '5', 249),
(267, '2', 194, '- Ketepatan dalam menjelaskan tentang susunan kimia minyak atsiri\r\n- Ketepatan dalam menjelaskan tentang sumber minyak atsiri\r\n- Ketepatan dalam menjelaskan kegunaan minyak atsiri', 'Kriteria:\r\nPortofolio showcase\r\n\r\nBentuk:\r\n- Non-Test:\r\n- Ringkasan artikel jurnal\r\n- Makalah tentang struktur dan susunan kimia minyak atsiri', ' Kuliah\r\n Diskusi Kelompok\r\n Kerja Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 2:\r\n- Mengkaji dan mensarikan artikel jurnal dan membuat makalah tentang struktur dan susunan kimia minyak atsiri.\r\n[PT+BM:(1+1)x(2x60)]', ' Chatting dan diskusi pada forum e-Learning: http://ilmu.upnjatim.ac.id\r\n Chatting dan diskusi pada WhatsApp\r\n Membaca text dan media pembelajaran ppt, http://ilmu.upnjatim.ac.id', ' Susunan kimia minyak atsiri\r\n Sumber minyak atsiri\r\n Kegunaan minyak atsiri', '10', 249),
(268, '3-7', 197, 'Ketepatan dalam menguraikan cara memproduksi minyak atsiri menggunakan metode penyulingan sesuai dengan metode yang telah digunakan saat ini secara benar', 'Kriteria:\r\nPedoman penskoran marking scheme\r\nBentuk:\r\n- Non-Test:\r\n- Diskusi Kelompok\r\n- Tugas Kelompok\r\n- Test:\r\nUTS', 'Minggu 3:\r\n Kuliah\r\n Diskusi Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 3:\r\nMeringkas matakuliah dalam bentuk uraian singkat tentang penyulingan dengan air, uap, dan uap air\r\n[PT+BM:(1+1)x(2x60)]\r\n\r\nMinggu 4:\r\n Kuliah\r\n Diskusi Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 4:\r\nStudi kasus tentang penyulingan menggunakan metode ultrasonic dan microwave.\r\n[PT+BM:(1+1)x(2x60)]\r\n\r\nMinggu 5:\r\n Kuliah\r\n Diskusi Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 5:\r\nMeringkas matakuliah dalam bentuk uraian singkat tentang hidrodestilasi bahan tanaman pada tekanan tinggi dan rendah dengan uap superheated, penyulingan dengan uap dan tekanan tinggi, penyulingan dengan air dan tekanan tinggi, penyulingan dengan uap dan tekanan rendah.\r\n[PT+BM:(1+1)x(2x60)]\r\n\r\nMinggu 6:\r\n Kuliah\r\n Diskusi Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 6:\r\nMeringkas matakuliah dalam bentuk uraian singkat tentang penyulingan dengan air pada tekanan rendah,uap lewat panas\r\n[PT+BM:(1+1)x(2x60)]\r\n\r\nMinggu 7:\r\n Kuliah\r\n Diskusi Kelompok\r\n[TM: 1x(2x50)]\r\n Tugas 7:\r\nMeringkas matakuliahdalam bentuk uraian singkat tentang rektifikasi dan fraksinasi minyak atsiri\r\n[PT+BM:(1+1)x(2x60)]', ' Chatting dan diskusi pada forum eLearning: http://ilmu.upnjatim.ac.id\r\n Chatting dan diskusi pada WhatsApp\r\n Membaca text\r\ndan media\r\npembelajaran\r\nppt,\r\nhttp://ilmu.upnjatim.ac.id\r\n\r\nMinggu 3:\r\n Penyulingan dengan air\r\n Penyulingan dengan uap\r\n Penyulingan dengan air dan uap\r\n\r\n', 'Minggu 3:\r\n Penyulingan dengan air\r\n Penyulingan dengan uap\r\n Penyulingan dengan air dan uap\r\n\r\nMinggu 4:\r\n Penyulingan dengan menggunakan metode ultrasonic\r\n Penyulingan meng