(49, 54, 'Non Tes', 'Membuat bahasa natural, flowchart, pseudocode, dan kode script Python pada studi kasus algoritma sekuensial: \r\na. Konversi suhu \r\nb. Luas lingkaran \r\nc. Indeks Masa Tubuh', 67),
(50, 56, 'Non Tes', 'Membuat flowchart/pseudocode dan kode script Python dengan pada studi kasus struktur percabangan tunggal maupun bersarang: \r\na. Karakter huruf vokal dan konsonan dengan kondisi if-else \r\nb. Bilangan terbesar dari 3 input bilangan dengan kondisi if-else \r\nc. Program aritmatika sederhana dengan kondisi switch -case d. Program mencari akar - akar persamaan kuadrat dengan kondisi if-if- else-else', 67),
(51, 59, 'Non Tes', 'Membuat flowchart/pseudocode dan kode script Python dengan pada studi kasus struktur percabangan tunggal maupun bersarang: \r\na. Deret Bilangan Pangkat Tiga dengan for loop \r\nb. Deret Akar Bilangan dengan while loop \r\nc. Deret Faktorial Bilangan dengan do - while loop \r\nd. Deret Bilangan Ganjil Selain Kelipatan 3 dengan continue \r\ne. Deret Bilangan Ganjil Selain Kelipatan 7 serta 11, dan Bilangan yang ditampilkan <100 dengan continue dan break \r\nf. Menentukan Quarter dari suatu Nama Bulan menggunakan goto \r\ng. Drawing Star Pattern dalam Bentuk Segitiga dengan nested loop', 67),
(52, 67, 'Non Tes', 'Membuat flowchart/pseudocode dan kode script Python dengan pada studi kasus struktur data array berdimensi 1, 2, dan multidimensi: \r\na. Memeriksa nilai maksimum dan nilai minimum dari suatu deret dengan array berdimensi 1 \r\nb. Mengurutkan deret angka secara ascending dan descending dengan array berdimensi 1\r\nc. Input mata kuliah dan jumlah jam untuk menghitung Indeks Prestasi semester dengan array berdimensi 2 \r\nd. Membuat input karakter dengan ukuran tertentu dengan array berdimensi 2 \r\ne. Input elemen array berdimensi 3', 67),
(53, 72, 'Non Tes', 'Membuat flowchart/pseudocode dan kode script Python dengan pada studi kasus konsep fungsi dasar dan rekursif: \r\na. Membuat konversi suhu celcius ke reamur, kelvin, dan fahrenheit menggunakan function \r\nb. Penggunaan function (sqrt, exp, log, log10, cos, pow, degrees, radians, fabs ) pada pustaka math \r\nc. Penggunaan function randrange pada pustaka random untuk acak dadu dan memberikan reward pada dadu kembar \r\nd. Pembuktian faktorial dari 0!=1 \r\ne. Pembuktian 1%2 = 1', 67),
(54, 75, 'Non Tes', 'Membuat flowchart/pseudocode dan kode script Python dengan pada studi kasus konsep algoritma pencarian: Interpolation Search (Project-based Learning)', 67),
(55, 53, 'Non Tes', 'Peserta kuliah secara kelompok membuat PPT mengenai penerapan metode statistika pada permasalahan riil, terminologi - terminologi dalam metode statistika, Tujuan metode statistika untuk menyelesaikan permasalahan data sains, dan contoh penerapan statistika diskripsi dan inferensi dalam suatu permasalahan data science. Jawaban disertai sumber pustaka yang jelas, lalu dipresentasikan melalui video.', 66),
(56, 55, 'Non Tes', 'Peserta kuliah secara kelompok mencari data satu variabel dengan jumlah sampel minimal 200, kemudian di analisis menggunakan statistika deskripsi secara numerik maupun visual yang kemudian dipresentasika n di dalam kelas pada pekan selanjutnya', 66),
(57, 57, 'Non Tes', 'Peserta kuliah secara kelompok menyelesaika n soal yang diberikan oleh Dosen mengenai Probabilitas suatu kejadian dan distribusi probabilitas . Masingmasing kelompok mendapatkan soal yang berbeda-beda, hasilnya dipresentasika n di dalam kelas pada pekan selanjutnya', 66),
(58, 58, 'Non Tes', 'Peserta kuliah secara kelompok menyelesaikan soal yang diberikan oleh Dosen mengenai distribusi diskrit dan distribusi kontinu. Masing-masing kelompok mendapatkan soal yang berbeda-beda, hasilnya dipresentasikan di dalam kelas pada pekan selanjutnya', 66),
(59, 60, 'Non Tes', 'Peserta kuliah membentuk suatu kelompok untuk menemukan permasalahan yang akan dirancang samplingnya, dihitung besaran sampel serta memilih sampel berdasarkan metode yang tepat. Outputnya adalah laporan dan PPT yang dipresentasika n di dalam kelas pada pekan selanjutnya', 66),
(60, 64, 'Non Tes', 'Peserta kuliah secara kelompok menyelesaikan soal yang diberikan oleh Dosen mengenai pendugaan parameter dan pengujian hipotesis. Masing-masing kelompok mendapatkan soal yang berbeda-beda, hasilnya dipresentasikan di dalam kelas pada pekan selanjutnya', 66),
(61, 70, 'Non Tes', 'Peserta kuliah secara kelompok mencari permasalahan, mencari data yang akan digunakan, mengolah dan menganalisis data, serta memberikan kesimpulan yang sesuai. Output yang dihasilkan setiap kelompok adalah Laporan dan PPT yang dipresentasikan pada minggu ke-3.', 66),
