(10, 'bk3', 'sadsd sdad qqqq', 19),
(11, 'bk4', 'sdsd frttrrwerw', 19),
(119, 'BK01 Math', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengembangkan pemahaman mengenai konsep-konsep matematika yang terkait dengan analisis data. Beberapa topik yang dibahas adalah kalkulus, aljabar linear, statistik matematika, dan probabilitas.', 18),
(127, 'BK02 Statistical methods ', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat menggunakan metode statistik untuk memproses dan menganalisis. Bahan kajian ini mencakup topik seperti analisis regresi, analisis multivariat, pengujian hipotesis, dan analisis data tak terstruktur.', 18),
(129, 'BK03 Data Analysis', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengumpulkan, mengolah, dan menginterpretasi data untuk mendapatkan pemahaman yang lebih baik tentang suatu fenomena atau masalah diberbagai bidang. Beberapa topik yang dibahas adalah analisis data univariat, hubungan antar dua varianel, dan analisis data multivariat. ', 18),
(130, 'BK04 Machine Learning', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengembangkan pemahaman mahasiswa mengenai algoritma dan teknologi untuk membuat sistem atau mesin belajar dari data dan mengambil keputusan secara otomatis tanpa bantuan manusia. Beberapa topik yang dibahas adalah algoritma clustering, algoritma decision tree, algoritma klasifikasi, dan algoritma regresi.', 18),
(131, 'BK05 Data Mining', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat untuk mengekstrak informasi yang bermanfaat dari data besar. Beberapa topik yang dibahas adalah analisis asosiasi, analisis klaster, analisis sequential, dan analisis keterhubungan.', 18),
(132, 'BK06 Computational modelling, simulation and optimization', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat menggunakan komputer dan teknologi untuk membangun model dan simulasi dari sistem dan proses yang kompleks. Bahan kajian ini bertujuan untuk meningkatkan kinerja dan efisiensi sistem tersebut melalui optimisasi.', 18),
(133, 'BK07 Visualization dan storytelling', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengembangkan kemampuan mahasiswa dalam menyajikan data dan informasi secara visual dan menarik. Hal ini bertujuan untuk membantu orang memahami dan menganalisis informasi dengan lebih mudah dan efektif.', 18),
(134, 'BK08 Programming, data structures and algorithms', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengembangkan aplikasi dan algoritma yang digunakan dalam pengolahan data. Beberapa topik yang dibahas adalah bahasa pemrograman Python, Java, C++, algoritma sorting, algoritma searching, dan struktur data seperti array, stack, queue, dan linked list', 18),
(135, 'BK09 Computing and Computer Fundamentals', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari konsep dasar komputasi dan komputer, termasuk perangkat keras dan perangkat lunak. Bahan kajian ini mencakup topik seperti arsitektur komputer, sistem operasi, jaringan komputer, dan database.', 18),
(136, 'BK10 Data Acquisition, Management, and Governance (DG)', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengumpulkan data secara efektif dan efisien, serta mengelola dan mengontrol akses data dengan baik. Melalui bahan kajian ini, mahasiswa akan mempelajari tentang berbagai teknik pengumpulan data seperti survey, eksperimen, observasi, dan sebagainya. Selain itu, mahasiswa juga akan mempelajari teknik dan strategi manajemen data yang meliputi pengelolaan database, perawatan data, dan standarisasi data. Mahasiswa juga akan mempelajari mengenai isu-isu terkait dengan governance data seperti hak akses, keamanan data, dan kebijakan privasi.', 18),
(137, 'BK11 Data Privacy, Security, Integrity, and Analysis for Security', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat menjaga privasi, keamanan, dan integritas data, serta melakukan analisis untuk keperluan keamanan. Melalui bahan kajian ini, mahasiswa akan mempelajari teknik dan alat untuk melindungi data dari ancaman seperti hacking, virus, dan serangan siber lainnya. Selain itu, mahasiswa juga akan mempelajari tentang kebijakan privasi data dan regulasi yang berkaitan dengan pengumpulan dan penggunaan data. Mahasiswa juga akan mempelajari tentang teknik analisis data untuk keperluan keamanan seperti analisis forensik dan analisis risiko.', 18),
(138, 'BK12 Data management systems', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari tentang konsep dan teknologi sistem manajemen data, termasuk database relasional dan non-relasional, pengolahan query, integrasi data, dan teknik penyimpanan dan pengambilan data.', 18),
(139, 'BK13 Professionalism', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari prinsip dan etika profesi di bidang sains data. Mahasiswa akan mempelajari tentang tanggung jawab, keterampilan, dan perilaku profesional yang diperlukan untuk bekerja dalam lingkungan sains data yang berkembang.', 18),
(140, 'BK14 Business Process Management', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengelola proses bisnis, termasuk analisis, desain, implementasi, pemantauan, dan pengoptimalan proses bisnis. Mahasiswa akan belajar tentang teknik manajemen proses bisnis dan alat-alat untuk meningkatkan efisiensi dan efektivitas proses bisnis.', 18),
(141, 'BK15 Predictive analytics', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari teknik analisis data yang digunakan untuk membuat prediksi dan memperoleh wawasan yang berguna dari data. Mahasiswa akan mempelajari tentang model prediksi dan teknik machine learning untuk memproses data dan membuat prediksi.', 18),
(142, 'BK16 Big Data infrastructure and technologies', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari teknologi dan infrastruktur yang digunakan untuk mengelola, menyimpan, dan memproses data dalam skala besar. Mahasiswa akan mempelajari tentang sistem file terdistribusi, infrastruktur penyimpanan data, dan teknologi infrastruktur lainnya yang digunakan untuk big data. ', 18),
(143, 'BK17 Infrastructure and platforms for Data Science', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari infrastruktur dan platform yang digunakan dalam sains data, termasuk alat analisis data, alat manajemen sumber daya, dan alat pengembangan perangkat lunak untuk sains data.', 18),
(144, 'BK18 Cloud Computing technologies for BD and DA', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari teknologi cloud computing dan layanan yang digunakan untuk big data dan analisis data. Mahasiswa akan mempelajari tentang teknologi cloud computing seperti SaaS, PaaS, dan IaaS, serta teknologi big data yang terintegrasi dengan cloud computing.', 18),
(145, 'BK19 Big Data systems organization and engineering', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajaru organisasi dan teknik pengembangan sistem big data, termasuk strategi pengembangan, manajemen proyek, dan pengembangan perangkat lunak. Mahasiswa akan mempelajari tentang teknik pengembangan sistem big data dan strategi pengembangan perangkat lunak yang efektif.', 18),
(146, 'BK20 Data Science/Big Data application design', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari desain aplikasi data science dan big data, termasuk pemahaman tentang kebutuhan pengguna dan pengumpulan persyaratan, desain dan pengembangan aplikasi, serta pengujian dan penyebaran aplikasi. Mahasiswa akan mempelajari tentang teknik desain aplikasi data science dan big data. ', 18),
(147, 'BK21 Text Mining', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari  teknik pengolahan data teks, seperti teks dokumen, pesan teks, dan data teks lainnya. Materi ini meliputi pemrosesan bahasa alami, ekstraksi fitur, dan klasifikasi teks.', 18),
(148, 'BK22 Data Management and Enterprise data infrastructure', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat  mengelola data pada skala besar dalam konteks infrastruktur data perusahaan. Materi ini meliputi desain arsitektur data, pengelolaan sumber daya data, dan pengembangan data warehouse.', 18),
(149, 'BK23 Big Data storage (large scale)', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari tentang teknologi penyimpanan data skala besar dan cara mengelola data secara efektif dalam lingkungan big data. Materi ini meliputi Hadoop Distributed File System (HDFS), NoSQL databases, dan teknologi penyimpanan data lainnya.', 18),
(150, 'BK24 Artificial Intelligence', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mengembangkan sistem cerdas yang mampu mengambil keputusan berdasarkan data. Materi ini meliputi pembelajaran mesin, jaringan saraf tiruan, dan logika kabur.', 18),
(151, 'BK25 Software Development and Maintenance', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat mempelajari tentang pengembangan dan pemeliharaan perangkat lunak untuk pengolahan data. Materi ini meliputi metodologi pengembangan perangkat lunak, pengujian perangkat lunak, dan manajemen kode sumber.', 18),
(152, 'BK26 Language Skills', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat meningkatkan ketrampilan dalam mendengarkan, berbicara, membaca, dan menulis bahasa tertentu dan suatu data pada berbagai bidang. ', 18),
(153, 'BK27 Leadership and National Defense', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat memahami secara komprehensif tentang teori, konsep, dan keterampilan praktis yang diperlukan untuk menjadi pemimpin yang efektif dalam berbagai konteks organisasi dan sosial. Materi ini meliputi teori kepemimpinan, ketrampilan kepemimpinan, etika dan kepemimpinan, kepemimpinan transformasional,  Kepemimpinan Situasional, Kepemimpinan Tim dan Kolaboratif, Kepemimpinan Situasional, Kepemimpinan Tim dan Kolaboratif, Kepemimpinan dalam Konteks Global, Studi Kasus Kepemimpinan, Pengembangan Kepemimpinan, Pengembangan Kepemimpinan, dan Evaluasi Kinerja Kepemimpinan. ', 18),
(154, 'BK28 Transformational Leadership', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa dapat meningkatkan keberanian, integritas, empati, dan kemampuan komunikasi yang kuat. Serta dapat meningkatkan sifat-sifat kepemimpinan dalam diri mahasiswa. ', 18),
(155, 'BK29 Creativity and Problem Solving', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa memiliki  pemahaman yang komprehensif tentang konsep kreativitas dan problem solving serta memberikan mahasiswa dengan keterampilan dan pengetahuan yang diperlukan untuk menjadi pemecah masalah yang inovatif dan kreatif dalam berbagai konteks. ', 18),
(156, 'BK30 Scientific/Research Methods', 'Kajian-kajian, tori-teori, dan sumber-sumber terpercaya serta implementasi bidang ilmu yang berkaitan dengan bahan kajian sehingga mahasiswa memiliki  pemahaman yang komprehensif tentang proses penelitian ilmiah serta mempersiapkan mahasiswa dengan keterampilan dan pengetahuan yang diperlukan untuk merancang, melaksanakan, menganalisis, dan melaporkan penelitian yang sesuai dengan format yang ditentukan. ', 18),
(157, 'BK-1: Pancasila ', 'Membahas substansi falsafah Pancasila berikut perkembangannya menjadi ideologi yang memenuhi syarat sebagai kaidah fundamental negara. Pembahasan-pembahasan yang dikembangkan dalam mata ajaran ini meliputi pengertian Pancasila, UUD 1945, Kedudukan dan Fungsi Pancasila, Pancasila sebagai sistem, filsafat, dan ideologi Pancasila ', 28),
(158, 'BK-2: Belanegara', 'Mata Kuliah Pendidikan Bela Negara merupakan mata kuliah wajib yang harus ditempuh mahasiswa UPN \"Veteran\" Jawa Timur, yang berisi tentang konsep, teori, dan aplikasi bela negara dalam kehidupan berbangsa dan bernegara. Setelah menyelesaikan mata kuliah ini mahasiswa diharapkan menjadi mahasiswa yang memiliki mental, jati diri, dan kepribadian yang kental dengan nilai kejuangan dan kebangsaan sebagai generasi penerus calon pemimpin masa depan dan juga diharapkan akan menjadi lulusan yang handal, cerdas intelektual, emosi, \'spiritual dan punya wawasan kebangsaan serta bersenjatakan ilmu untuk membantu membela harkat dan martabat bangsa dan negara ', 28),
(159, 'BK-3: Pendidikan Agama', 'Mata ajaran ini akan diawali dengan pemahaman tentang pengertian Agama Islam secara utuh dan menyeluruh. Selain masalah keimanan akan dibahas pula ihwal ibadah yaitu kaidah yang menyangkut hubungan antara manusia dengan Tuhan/khaliknya, antara manusia dengan sesamanya, dan antara manusia dengan makhluk lain dan alam. Selain diarahkan ke terbinanya kesadaran untuk melaksanakan kewajiban kepada Tuhan Yang Maha Esa, pembahasannya juga tertuju ke arah kewajiban-kewajiban manusia kepada diri sendiri, masyarakat, bangsa, dan negaranya. Penekanan pada pembahasan sifat umum ajaran Islam tentang keserasian dan keseimbangan antara pola hidup dunia dan ukhrowi ', 28),
(160, 'BK-4: Analisis dampak pariwisata', 'Membahas mengenai definisi dampak pariwisata, prinsip-prinsip manajemen lingkungan, pentingnya analisis mengenai dampak pengembangan pariwisata, peraturan perundangan mengenai dampak lingkungan, sumber dan bentuk dampak pariwisata terhadap lingkungan, karakteristik dampak pariwisata, dampak pariwisata terhadap keanekaragaman hayati dan sosial ekonomi budaya masyarakat, metode-metode pengukuran dan penentuan kriteria dampak pariwisata, manajemen dampak pariwisata ', 28),
(161, 'BK-5: Analisis SWOT ', 'Membahas mengenai penggunaan analisis SWOT yang terdiri dari kekuatan, kelemahan, peluang dan ancaman dalam penyususnan strategi pengembangan pariwisata ', 28),
(162, 'BK-6: Impelemntasi kebijakan, peraturan hukum dan perundangan ', 'Mata kuliah ini membahas ruang lingkup, fungsi dan jenis hukum dan kebijakan di industri pariwisata, cara memformulasikan kebijakan ekowisata, dampak hukum dan kebijakan di Industri pariwisata, peran-peran pemangku kepentingan di dalam hukum dan kebijakan pariwisata, model-model untuk kebijakan pariwisata, fungsi dari beberapa model kebijakan pariwisata', 28),
(163, 'BK-7: Pelayanan prima', 'Membahas mengenai Perilaku Wisatawan, Dimensi Psikologi Wisatawan (Sosial, Lingkungan, Ekonomi, Kognitif), Standar Pelayanan Wisatawan, Faktor  factor yang mempengaruhi kepuasan wisatawan, Ecotourist environmental learning opportunity, Penanganan Complaint wisatawan, Dampak Perilaku Wisatawan ', 28),
(164, 'Elemen Kebahasaan', 'Vocabulary\r\n\r\nPronunciation Practice\r\nBasic Grammar in Use\r\nIntermediate Grammar in Use\r\nAdvanced Grammar in Use\r\nGrammar in EL', 30),
(165, 'Keterampilan Berbahasa', 'Book Report\r\n\r\nBasic Listening and Speaking\r\nBasic Reading and Writing\r\nIntermediate Listening and Speaking\r\nIntermediate Reading and Writing\r\nAdvanced Listening and Speaking\r\nAdvanced Reading and Writing\r\nCreative Writing\r\nStandardized Test\r\nCross Cultural Understanding', 30),
(166, 'Ilmu Bahasa', 'Introduction to Linguistics\r\nIntroduction to English Phonetics and Phonology\r\nTheories and Practice of Translation', 30),
(167, 'Penelitian dalam dunia pendidikan.', 'Research methods\r\nResearch Proposal\r\nThesis/Research Page', 30),
(168, 'Sosial kemasyarakatan', 'Pendidikan Agama\r\n\r\nPendidikan Pancasila\r\nBahasa Indonesia\r\nPendidikan Kewarganegaraan\r\nKuliah Kerja Nyata', 30),
(169, 'Ilmu Kewirausahaan', 'Kewirausahaan', 30),
(170, 'BK-8: Promosi dan pemasaran ', 'Membahas tentang prinsip etika bisnis, norma dan etika umum dalam bidang pemasaran, tata krama dan cara periklanan, etika perusahaan terhadap konsumen usaha pariwisata, etika dalam komunikasi bisnis pariwisata dan ITE (Informasi dan Transaksi Elektronik), etika pasar bebas dan globalisasi, definisi pemasaran, tujuan pemasaran, target pemasaran dan segmentasi pasar, bauran pemasaran, perilaku konsumen pariwisata, strategi pemasaran pariwisata, strategi penetapan harga usaha pariwisata, digital marketing usaha pariwisata', 28),
(171, 'BK-9: Manajemen keuangan', 'membahas mengenai definisi dan konsep kelayakan pariwisata, tipe dan macam kelayakan pariwisata, kriteria dan indikator penilaian kelayakan pariwisata, pendekatan penilaian kelayakan pariwisata, tahapan dalam studi kelayakan pariwisata, peran penilaian dalam pengembangan suatu usaha pariwisata, konsep \r\nnilai uang, analisis kelayakan pariwisata', 28),
(172, 'BK-10: K3L', 'mempelajari terkait definisi K3, Tujuan K3,  UU dan peraturan  mengenai K3, ruang lingkup K3 pada bidang pariwisata, Penyebab kecelakan, Sistem K3 Pariwisata, Standar K3, kecelakaan dan keselamatan wisatawan, serta best practices penerapan K3 pada bidang pariwisata ', 28),
(173, 'BK-11: Konservasi dan edukasi ', 'Membahas tentang ruang lingkup konservasi yang meliputi: Pengertian, tujuan, manfaat dan upaya-upaya konservasi sumber daya alam dan lingkungan (SDAL); Etika lingkungan yang meliputi: Pengertian, Paradigma, dan Prinsip-prinsip Etika Lingkungan; Sumber daya alam yang meliputi: Pengertian, jenis-jenis dan manfaat Sumber Daya Alam; Kearifan lokal yang meliputi: Pengertian, pendekatan, tantangan dan kearifan lokal dalam kehidupan masyarakat di masa yang akan datang; Pengelolaan dan permasalahan sumber daya alam dan lingkungan yang meliputi: isu-isu, permasalahan dan pengelolaan sumber daya alam dan lingkungan; Sadar konservasi yang meliputi, kesadaran pentingnya konservasi sumber daya alam dan lingkungan, eco campus dan kampus konservasi. Regulasi Konservasi sumber Daya Alam dan Lingkungan', 28),
(174, 'BK-12: Ekowisata ', 'Membahas tentang mengenai definisi ekowisata, supply dan demand ekowisata, prinsip-prinsip ekowisata, perencanaan ekowisata, ekowisata dan pembangunan berkelanjutan, perkembangan ekowisata di Indonesia, best practice pengelolaan ekowisata di Indonesia', 28),
(175, 'BK-13: Pembangunan pariwisata berkelanjutan', 'Materi mengenai perencanaan pembangunan pariwisata yang mengedepankan keberadaan aspek lainnya seperti lingkungan, sosial budaya masyarakat, serta ekonomi baik mikro maupun makro. Pemahaman konseptual mengenai pembangunan pariwisata berkelanjutan, pemenuhan kebutuhan pariwisata yang bertahan saat ini dan saat mendatang dengan memperhatikan daya dukung ekosistem, kualitas kehidupan, dukungan sumber daya pariwisata serta sinergi antar sektor, siklus pariwisata ', 28),
(176, 'BK-14 Sistem pariwisata dan fenomena pariwisata; ', 'Membahas tentang konsep dasar kepariwisataan, konsep waktu luang, rekreasi dan bentuk kegiatan waktu luang, sistem kepariwisataan:unsur-unsur yang terkait dalam kepariwisataan, dampak positif dan negatif dari kepariwisataan, motivasi perjalanan wisata; pengertian dan kebutuhan motivasi perjalanan, faktor-faktor yang mempengaruhi motivasi perjalanan, bentuk dan klasifikasi wisatawan nusantara dan mancanegara, pengalaman wisata dan hubungannya dengan produk wisata, pola dan bentuk perjalanan wisatawan institusional dan non institusional, produk wisata dan komponen produk wisata, karakteristik produk wisata, konsep dan teknik pelayanan wisata ', 28),
(177, 'BK-15: Sumber daya, infrastruktur, dan daya tarik pariwisata; ', 'Mata Kuliah membahas mengenai kajian pariwisata dalam perspektif ilmu geografi, dalam pendekatan keruangan di kegiatan pariwisata mengkaji mengenai suatu wilayah atau region di permukaan bumi. Menganalisis dari aspek morfologi dari pariwisata, letak atau lokasi dengan melakukan perjalanan sesuai rute. Membahas mengenai sistem pariwisata, hubungan host and guest serta tujuan dan bentuk perjalanan, dalam rangka meningkatkan potensi dan nilai dari sebuah daerah tujuan wisata', 28),
(178, 'BK-16: Tipologi dan perilaku wisatawan;', 'Materi mata kuliah ini membahas berbagai konsep, perkembangan, dan pengelolaan hospitalitas yang terdiri atas tourism, lodging (hotel dan sejenisnya), restaurants, managed services, food & beverages, conventions and meeting, dan leisure/recreation. Akan dibahas juga dampak globalisasi dan tanggung jawab lingkungan, grooming, profil para profesional hospitalitas, SDM, leadership, management, serta karier dalam industri hospitalitas ', 28),
(179, 'Bahasa Inggris untuk Pariwisata', 'English for Tourism', 30),
(180, 'Bahasa Inggris untuk belanegara', 'Belanegara\r\nEnglish for state defense', 30),
(181, 'Bahasa Inggris untuk jurnalistik', 'English for journalism', 30),
(182, 'BK-17: Siklus hidup pariwisata', 'Membahas mengenai tahapan dalam pariwisata mulai dari awal hingga inovasi kembali ', 28),
(183, 'BK-18: Antropologi budaya wisatawan;', 'Membahas tentang materi tentang antropologi pariwisata pada umumnya beserta aspek-aspek, dampak, perkembangan, hubungan hingga penyelesaian suatu masalah kepariwisataan nasional yang ditinjau dari antropologi. ', 28),
(184, 'BK-19: Manajemen operasional (perencanaan, pelaksanaan, pengarahan, pemantauan, evaluasi, dan pengendalian) organisasi layanan jasa dan produk pariwisata; ', 'Membahas secara komprehensif manajemen daya tarik wisata yang melibatkan masyarakat dalam pengelolaannya. Membahas juga pengusahaan daya tarik wisata meliputi kegiatan membangun dan mengelola daya tarik wisata beserta prasarana dan sarana yang diperlukan atau kegiatan mengelola daya tarik wisata yang telah ada. Membahas manajemen daya tarik wisata sesuai kelompoknya masing-masing yaitu daya tarik wisata alam, daya tarik wisata budaya dan daya tarik wisata minat khusus', 28),
(185, 'BK-20: Manajemen SDM, keuangan, logistik organisasi layanan jasa dan produk pariwisata', 'Membahas mengenai definisi dan konsep manajemen sumber daya manusia dengan prinsip ekowisata (lingkungan, sosial dan budaya, ekonomi, serta konservasi), fungsi dan peran manajemen sumber daya manusia dalam pengembangan pariwisata, sejarah perkembangan manajemen sumber daya manusia, macam dan bentuk pendekatan manajemen sumber daya manusia, tahapan dalam manajemen sumber daya manusia, urgensi manajemen sumber daya manusia dalam kegiatan pariwisata ', 28),
(186, 'BK-21: Penilaian daya Tarik wisata ', 'Melakukan penilaian daya tarik wisata yang akan dikembangkan ', 28),
(187, 'BK-22: Komunikasi lisan dan tulisan dalam bahasa Indonesia, minimal satu bahasa internasional atau minimal satu bahasa asing lainnya; ', 'Merupakan mata kuliah yang akan menambah pengetahuan dan kecakapan mahasiswa program studi Pariwisata untuk menguasai bahasa asing selain Bahasa \r\ninggris', 28),
(188, 'BK-23: Analisis laporan dan rasio keuangan minimal tingkat pengembalian investasi (ROI), nilai bersih sekarang (NPV), nilai bersih yang akan datang (FV) dan tingkat pengembalian investasi (IRR); ', 'Membahas mengenai definisi dan konsep bisnis ekowisata, bentuk-bentuk badan usaha dan skala usaha, peluang dan hambatan bisnis ekowisata, resiko bisnis ekowisata, strategi dan teknik membangun bisnis ekowsiata, perencanaan, manajemen bisnis ekowisata, best practice bisnis ekowisata dan evaluasi keberhasilan bisnis ekowisata', 28),
(189, 'Ekonomi dan Politik (BK-1)', 'Membahas tentang Pengantar Ilmu Ekonomi, Pengantar Ilmu Politik, Sistem Politik Indonesia, Sistem Ekonomi Indonesia, Bisnis Internasional, serta Pasar Modal', 24),
(190, 'Ilmu Administrasi (BK-2)\r\n\r\n', 'Mata Kuliah Ilmu Administrasi merupakan mata kuliah wajib yang harus ditempuh mahasiswa UPN \"Veteran\" Jawa Timur, yang berisi tentang pengantar administrasi bisnis, akuntansi I, akuntansi II, Administrasi perpajakan, akuntansi biaya, analisa laporan keuangan', 24),
(191, 'Manajemen dan Stategi Bisnis\r\n(BK-3)\r\n', 'Mata ajaran ini akan diawali dengan pemahaman tentang asas-asas manajemen, coorporate governance, digital marketing dan e-commerce, etika bisnis, hubungan industrial, kebijakan dan strategi bisnis, kepemimpinan, komunikasi bisnis, manajemen keuangan, manajemen pemasaran, manajemen perubahan, pemasaran, perilaku organisasi, sumber daya manusia, teori pengambilan keputusan, SDM Internasional', 24),
(192, 'Entrepreneur dan Industri Kreatif\r\n(BK-4)\r\n', 'Membahas mengenai definisi pasar modal, pengantar ilmu ekonomi, pengantar ilmu politik, sistem ekonomi Indonesia, Sistem Politik Indonesia, Pasar Modal, pengantar ilmu ekonomi, pengatar ilmu politik', 24),
(193, 'Metode Penelitian\r\n(BK-5)\r\n', 'Membahas mengenai pengantar statistik sosial, statistika bisnis,  metode penelitian seminar serta skripsi', 24),
(194, 'National mandatory course dan karakter Bela Negara (University Value)\r\n(BK-6)\r\n', 'Mata kuliah ini membahas pendidikan Pancasila, pendidikan Kewarganegaraan, Bahasa Indonesia untuk penulisan karya ilmiah, dan KKN', 24),
(195, 'Kajian  Dasar  dan bidang Komunikasi', '(CPL-4 Menguasai kaidah, perspektif, prinsip dan teknik komunikasi dalam berbagai ruang lingkup komunikasi, yakni komunikasi antarpribadi, komunikasi organisasi, komunikasi massa, komunikasi digital). Kajian Dasar dan Bidang Komunikasi mencakup pemahaman terhadap konsep-konsep dasar dalam ilmu komunikasi serta aplikasinya dalam berbagai bidang komunikasi yang relevan. Pemahaman tentang teori-teori komunikasi yang mendasari proses komunikasi manusia, serta pengetahuan dalam berbagai aspek komunikasi modern menjadi fokus dalam bahan kajian ini.', 26),
(196, 'PR  dan Perkembangannya, \r\nJurnalistik dan Penyiaran,\r\nKajian Media  Massa dan Perkembangannya,\r\nKajian Komunikasi Pemasaran', '(CPL-5: Mampu memahani  konsep Public Relations, Jurnalistik media massa, serta  komunikasi pemasaran dan periklanan  serta  perkembangan dan transformasi  ke arah digital) \r\nDeskripsi Bahan Kajian:\r\n\r\nPR dan Perkembangannya:\r\nBahan kajian ini memberikan pemahaman mendalam tentang Public Relations (PR) dan evolusinya dalam konteks modern. Mahasiswa akan mempelajari konsep dasar PR, strategi komunikasi yang efektif, manajemen reputasi, krisis, dan penggunaan teknologi digital dalam praktik PR. Mereka juga akan memahami peran PR dalam membangun hubungan baik dengan berbagai pemangku kepentingan (stakeholders) dan dampaknya terhadap citra perusahaan atau organisasi.\r\n\r\nJurnalistik dan Penyiaran:\r\nBahan kajian ini membahas teori dan praktik jurnalistik serta penyiaran dalam era digital. Mahasiswa akan mempelajari etika jurnalistik, prinsip dasar penyiaran, teknik penulisan berita, dan peran media dalam menyampaikan informasi kepada publik. Mereka juga akan memahami dinamika industri media, perkembangan teknologi dalam produksi konten, serta tantangan-tantangan yang dihadapi oleh jurnalis dan penyiar.\r\n\r\nKajian Media Massa dan Perkembangannya:\r\nBahan kajian ini mengulas peran dan pengaruh media massa dalam membentuk opini publik, budaya, dan politik. Mahasiswa akan mempelajari sejarah media massa, teori-teori komunikasi massa, serta tren perkembangan media terkini seperti media sosial, konvergensi media, dan transformasi digital. Mereka juga akan memahami kritik terhadap media massa serta implikasinya dalam konteks sosial dan politik.\r\n\r\nKajian Komunikasi Pemasaran:\r\nBahan kajian ini fokus pada strategi komunikasi dalam pemasaran produk atau jasa. Mahasiswa akan mempelajari konsep dasar pemasaran, penelitian pasar, segmentasi konsumen, promosi, branding, dan penggunaan media dalam kampanye pemasaran. Mereka juga akan memahami peran komunikasi pemasaran dalam memengaruhi perilaku konsumen dan menciptakan nilai bagi perusahaan atau merek.', 26),
(197, 'Kajian Komunikasi, Budaya  dan Masyarakat Digital ', '(CPL-6 Menguasai pengetahuan tentang literasi digital, media  dan informasi, \r\nmedia critisim serta perkembangan media dan masyarakat ) Bahan kajian ini memperkenalkan mahasiswa pada konsep-konsep yang berkaitan dengan interaksi antara komunikasi, budaya, dan masyarakat dalam konteks digital yang terus berkembang. Mahasiswa akan mempelajari bagaimana teknologi informasi dan komunikasi telah mengubah pola komunikasi, identitas budaya, dan dinamika sosial masyarakat. ', 26),
(198, 'Metode Penelitian', '(CPL-7 Mampu merancang dan melakukan penelitian di bidang komunikasi\r\ndengan metode penelitian yang kontemporer ). Bahan kajian ini merupakan aspek penting dalam program studi Ilmu Komunikasi karena memberikan landasan bagi mahasiswa untuk memahami cara-cara melakukan penelitian yang valid, relevan, dan dapat dipertanggungjawabkan. Melalui bahan kajian ini, mahasiswa akan mempelajari berbagai metode, teknik, dan pendekatan yang digunakan dalam menyusun dan melaksanakan penelitian di bidang komunikasi. ', 26),
(199, 'Kajian Digital Public Relations', '(CPL-8 Melalui konsentrasi PR, lulusan mampu menguasai  perkembangan nilai-nilai kehumasan dan etika humas). Bahan kajian ini memfokuskan pada praktik Public Relations (PR) dalam konteks digital yang terus berkembang. Dalam era di mana teknologi digital memainkan peran sentral dalam komunikasi, pemahaman yang mendalam tentang bagaimana PR beroperasi dalam lingkungan online menjadi sangat penting. ', 26),
(200, 'Kajian Digital Public Relations,\r\nJurnalistik dan Penyiaran ', '(CPL-9 Mampu merancang konsep dan melaksanakan konsep dan prinsip \r\nPublic Relations yang professional dalam  pekerjaan  kehumasan berbasisdigital serta mampu mengembangkan ide kreatif dan inovatif. ). Deskripsi Bahan Kajian \"Kajian Digital Public Relations\" dan \"Jurnalistik dan Penyiaran\":\r\nKajian Digital Public Relations:\r\nBahan kajian ini menyoroti praktik Public Relations (PR) dalam konteks digital yang terus berkembang. Mahasiswa akan dipandu untuk memahami bagaimana PR beradaptasi dengan perubahan teknologi dan tren komunikasi digital. \r\n\r\nJurnalistik dan Penyiaran:\r\nBahan kajian ini memperkenalkan mahasiswa pada teori dan praktik jurnalistik serta penyiaran. Mahasiswa akan memahami peran jurnalis dan penyiar dalam menyampaikan informasi kepada publik serta etika yang terlibat dalam profesi ini.\r\n', 26),
(201, 'Komunikasi Pemasaran Digital,\r\nKajian Komunikasi Budaya dan Masyarakat Digital ', '(CPL-10 Mampu merancang konsep, isi, dan\r\nbentuk  media kreatif  baru yang sesuai\r\ndengan  perkembangan jaman). Deskripsi Bahan Kajian \"Komunikasi Pemasaran Digital\" dan \"Kajian Komunikasi Budaya dan Masyarakat Digital\":\r\n\r\nKomunikasi Pemasaran Digital:\r\nBahan kajian ini membahas strategi dan praktik pemasaran dalam konteks digital yang terus berkembang. Mahasiswa akan mempelajari cara-cara memanfaatkan teknologi digital dan platform online untuk mencapai tujuan pemasaran.\r\n \r\nKajian Komunikasi Budaya dan Masyarakat Digital:\r\nBahan kajian ini menyoroti hubungan antara komunikasi, budaya, dan masyarakat dalam konteks digital yang terus berkembang. Mahasiswa akan memahami bagaimana teknologi digital memengaruhi pola komunikasi, identitas budaya, dan dinamika sosial masyarakat.', 26),
(202, 'Komunikasi Pemasaran Digital,\r\nKajian Komunikasi Budaya dan Masyarakat Digital ', '(CPL-11 Melalui konsentrasi Komunikasi Pemasaran, lulusan mampu melaksanakan konsep pemasaran termasuk  pemasaran   digital yang terus berkembang serta merancang strategi komunikasi pemasaran.).\r\nKomunikasi Pemasaran Digital:\r\nBahan kajian ini dirancang khusus untuk memenuhi CPL-11, yang menekankan kemampuan lulusan untuk melaksanakan konsep pemasaran, termasuk pemasaran digital yang terus berkembang. Mahasiswa akan mendalami strategi dan praktik dalam memasarkan produk atau layanan menggunakan media dan platform digital.\r\n\r\nKajian Komunikasi Budaya dan Masyarakat Digital:\r\nBahan kajian ini memberikan pemahaman yang mendalam tentang hubungan antara teknologi digital, budaya, dan masyarakat. Mahasiswa akan menganalisis bagaimana perkembangan teknologi informasi memengaruhi pola komunikasi, pembentukan identitas budaya, dan interaksi sosial dalam masyarakat digital. \r\n', 26),
(203, 'Komunikasi Pemasaran Digital,\r\nJurnalistik dan Penyiaran,\r\nKajian Media,\r\nKajian Komunikasi Budaya dan Masyarakat Digital', '(CPL-12 Mampu memproduksi karya media atau produk komunikasi (video, poster, visualisasi dan editing) dalam bentukmedia cetak maupun elektronik). Deskripsi Bahan Kajian \"Komunikasi Pemasaran Digital\", \"Jurnalistik dan Penyiaran\", \"Kajian Media\", dan \"Kajian Komunikasi Budaya dan Masyarakat Digital\":\r\n\r\nKomunikasi Pemasaran Digital:\r\nBahan kajian ini memberikan pemahaman mendalam tentang praktik pemasaran digital dan melatih mahasiswa untuk memproduksi karya media atau produk komunikasi yang sesuai dengan CPL-12. Mahasiswa akan belajar untuk membuat konten visual yang menarik seperti gambar, grafik, dan video promosi yang dapat digunakan dalam kampanye pemasaran digital. Mereka juga akan dilatih dalam teknik editing dan visualisasi untuk menghasilkan materi promosi yang efektif dalam format media elektronik seperti situs web, media sosial, atau iklan online.\r\n\r\nJurnalistik dan Penyiaran:\r\nDalam konteks jurnalistik dan penyiaran, bahan kajian ini akan mengajarkan mahasiswa untuk memproduksi konten media yang berkualitas dan informatif. Mereka akan dilatih dalam penulisan berita, pengambilan gambar, dan editing video untuk menciptakan berita atau program siaran yang sesuai dengan standar industri. Mahasiswa akan mempelajari bagaimana menghasilkan karya media cetak dan elektronik yang memenuhi kebutuhan audiens dan menjunjung tinggi prinsip jurnalisme yang etis.\r\n\r\nKajian Media:\r\nDalam kajian media, mahasiswa akan mendalami berbagai aspek produksi media dalam bentuk cetak maupun elektronik. Mereka akan belajar tentang peran media dalam menyampaikan informasi dan memengaruhi opini publik. Bahan kajian ini akan memberikan kesempatan kepada mahasiswa untuk mengembangkan keterampilan produksi media seperti penulisan artikel, desain grafis, pengeditan video, dan pembuatan konten yang menarik dalam format media cetak maupun elektronik.\r\n\r\nKajian Komunikasi Budaya dan Masyarakat Digital:\r\nDalam kajian ini, mahasiswa akan mempelajari bagaimana budaya dan masyarakat berinteraksi dengan media dan teknologi digital. Mereka akan dilatih untuk memahami dinamika komunikasi dalam masyarakat digital dan memproduksi karya media yang mencerminkan nilai-nilai budaya dan identitas masyarakat. Bahan kajian ini akan membantu mahasiswa dalam menghasilkan konten yang sensitif terhadap keberagaman budaya dan nilai-nilai yang relevan dengan audiens digital.', 26),
(204, 'Kajian  Media,\r\nKomunikasi Budaya dan Masyarakat Digital', '( CPL-13 Mampu melakukan kajian kritis pada iklan, film  dan   produk  media serta \r\nmedia sosial dan internet ).\r\nDeskripsi Bahan Kajian \"Kajian Media\" dan \"Komunikasi Budaya dan Masyarakat Digital\" berdasarkan CPL-13:\r\n\r\nKajian Media:\r\nBahan kajian ini akan melatih mahasiswa untuk melakukan kajian kritis pada berbagai jenis media, termasuk iklan, film, produk media lainnya, serta media sosial dan internet. Melalui kajian ini, mahasiswa akan memperoleh pemahaman mendalam tentang cara menganalisis dan mengevaluasi konten media secara kritis. \r\n\r\nKomunikasi Budaya dan Masyarakat Digital:\r\nBahan kajian ini akan menyoroti pentingnya memahami budaya dan masyarakat dalam konteks digital serta melatih mahasiswa untuk melakukan kajian kritis terhadap media dalam lingkungan digital.', 26),
(205, 'Jurnalistik dan Penyiaran ', '(CPL-14 Melalui konsentrasi Jurnalistik dan broadcast dan media digital  lulusan mampu memahami nilai-nilai jurnalisme dari tataran konseptual hingga kontekstual serta memahami dinamika industri media serta menjunjung tinggi etika jurnalisme. ). Bahan kajian ini bertujuan untuk mempersiapkan mahasiswa dengan pemahaman mendalam tentang nilai-nilai jurnalisme, dinamika industri media, dan etika jurnalistik dalam konteks era digital. ', 26),
(206, 'Komunikasi Pemasaran Digital,\r\nKewirausahaan ', '(CPL-15 Mampu mengembangkan  jiwa kewirausahaan dalam bidang  industry kreatif  didukung oleh prinsip-prinsip komunikasi digital.). Deskripsi Bahan Kajian \"Komunikasi Pemasaran Digital\" dan \"Kewirausahaan\"\r\nKomunikasi Pemasaran Digital:\r\nBahan kajian ini bertujuan untuk melatih mahasiswa dalam pengembangan jiwa kewirausahaan dalam konteks industry kreatif, terutama dalam praktik pemasaran digital. Mahasiswa akan belajar tentang strategi pemasaran digital dan teknik komunikasi yang diperlukan untuk mempromosikan produk atau layanan secara efektif dalam lingkungan digital yang terus berkembang. \r\n\r\nKewirausahaan:\r\nBahan kajian ini akan fokus pada pengembangan jiwa kewirausahaan dan aplikasi prinsip-prinsip komunikasi digital dalam berbagai konteks industri kreatif. Mahasiswa akan belajar tentang proses pendirian dan pengelolaan usaha kreatif, serta cara memanfaatkan teknologi digital untuk mendukung kesuksesan bisnis.', 26),
(211, 'BK-1\r\nPancasila\r\n\r\n', 'Membahas substansi falsafah Pancasila berikut perkembangannya menjadi ideologi yang memenuhi syarat sebagai kaidah fundamental negara.	Pembahasan-pembahasan	yang dikembangkan dalam mata ajaran ini meliputi pengertian Pancasila, UUD 1945, Kedudukan dan Fungsi Pancasila, Pancasila sebagai sistem, filsafat,\r\ndan ideologi Pancasila\r\n', 23),
(212, 'BK-2\r\nBelanegara', 'Mata Kuliah Pendidikan Bela Negara merupakan mata kuliah wajib yang harus ditempuh mahasiswa UPN \"Veteran\" Jawa Timur, yang berisi tentang konsep, teori, dan aplikasi bela negara dalam kehidupan berbangsa dan bernegara. Setelah menyelesaikan mata kuliah ini mahasiswa diharapkan menjadi mahasiswa yang memiliki mental, jati diri, dan kepribadian yang kental dengan nilai kejuangan dan kebangsaan sebagai generasi penerus calon pemimpin masa depan dan juga diharapkan akan menjadi lulusan yang handal, cerdas intelektual, emosi, \'spiritual dan punya wawasan kebangsaan serta bersenjatakan ilmu untuk membantu membela harkat dan martabat bangsa dan negara.', 23),
(213, 'BK-3\r\nPendidikan Agama', 'Mata ajaran ini akan diawali dengan pemahaman tentang pengertian Agama Islam secara utuh dan menyeluruh. Selain masalah keimanan akan dibahas pula ihwal ibadah yaitu kaidah yang menyangkut hubungan antara manusia dengan Tuhan/khaliknya, antara manusia dengan sesamanya, dan antara manusia dengan makhluk lain dan alam. Selain diarahkan ke terbinanya kesadaran untuk melaksanakan kewajiban kepada Tuhan Yang Maha Esa, pembahasannya juga tertuju ke arah kewajiban-kewajiban manusia\r\nkepada diri sendiri, masyarakat, bangsa, dan negaranya. Penekanan pada pembahasan sifat umum ajaran Islam tentang keserasian dan\r\nkeseimbangan antara pola hidup dunia dan ukhrowi\r\n', 23),
(214, 'BK-4\r\nHUMAS', 'Mampu berkomunikasi dengan rekan kerja, atasan, dan stakeholder lain atas nama instansi magang.', 23),
(215, 'BK-5\r\nPemberdayaan Masyarakat', 'Mampu menjelaskan pemberdayaan masyarakat melalui CSR, pembangunan berbasis masyarakat, pemberdayaan masyarakat miskin, dan partisipasi\r\ndan fasilitator dalam pemberdayaan masyarakat.', 23),
(216, 'BK-6\r\nImplementasi & Evaluasi Kebijakan', 'Mampu memahami tindakan birokrasi dalam menjalankan kebijakan.\r\nMampu menganalisis efektivitas kebijakan di mitra magang.', 23),
(217, 'BK-7\r\nManajemen Perkantoran', 'Mampu menguasai penggunaan informasi, organisasi perkantoran, tata ruang kantor dan tata kearsipan pada lokasi magang.', 23),
(218, 'BK-8\r\nAdministrasi Pemerintah Daerah', 'Mampu menjelaskan konsep otonomi daerah dan ruang lingkup pemerintah daerah.', 23),
(219, 'BK-9\r\nPerubahan Sosial', 'Mampu menjelaskan perubahan kebijakan\r\npelayanan konvensional ke era digital beserta realitas dinamika sosial masyarakat.', 23),
(220, 'BK-10\r\nManajemen Strategi Sektor Publik', 'Mampu menganalisis konsep teoritis administrasi, organisasi, birokrasi, kebijakan publik, pelayanan publik, perilaku organisasi, keuangan negara,\r\nreformasi administrasi, dan governansi publik pada mitra magang.', 23),
(221, 'BK-11\r\nManajemen Aset', 'Mampu menjelaskan konsep dasar manajemen aset, siklus manajemen aset, dan memahami pengelolaan barang milik negara dan daerah yang\r\nada pada mitra magang.', 23),
(222, 'BK-12\r\nKebijakan Pembangunan Desa', 'Mampu menganalisis interaksi antar aktor dalam\r\npenyusunan kebijakan dan manajemen pelayanan publik, baik di tingkat lokal maupun nasional.', 23),
(223, 'BK-13\r\nManajemen Pelayanan Publik', 'Mampu memahami SOP yang ada di tempat magang, dan menjalankan pelayanan sesuai SOP yang ada.', 23),
(224, 'BK-14\r\nManajemen dan Korporasi Sektor Publik\r\n', 'Mampu memahami tanggungjawab sosial korporasi (Corporate Social Responsibility/CSR) dari aspek ekonomi, masyarakat dan lingkungan.', 23),
(225, 'BK-15\r\nAdministrasi BUMN/BUMD\r\n', 'Mampu memahami tata kelola perusahaan BUMD, sistem kerja organisasi, peran BUMD dalam perekonomian daerah', 23),
(226, 'BK-16\r\nSosial Budaya Digital', 'Mampu memahami komunikasi multimedia\r\nberbasis TIK dan menjalankan sosial media pada mitra magang.', 23),
(227, 'BK-17\r\nGeopolitik dan SDA', 'Mampu menganalisis konsep geopolitik dan\r\nkeberadaan SDA (terutama pangan dan property) dalam menunjang pembangunan daerah.', 23),
(228, 'BK-18\r\nPendidikan dan Integritas Anti Korupsi', 'Mampu memahami pencegahan korupsi pada pelayanan publik.\r\nMampu melaksanakan pelayanan publik tanpa penyuapan, pemerasan, nepotisme pada saat menjalankan magang pada mitra.', 23),
(229, 'BK-19\r\nKebijakan Fiskal\r\n', 'Mampu menganalisis kebijakan pembangunan melalui APBD.', 23),
(230, 'BK-20\r\nKebijakan Pariwisata dan Ekonomi Kreatif', 'Mampu menganalisis isu strategis kepariwisataan,\r\nmagajerial, wirausaha, dan leadership.', 23),
(231, 'BK-21\r\nManajemen Konflik', 'Mampu menjelaskan konflik yang terjadi pada organisasi, dampak konflik, dan pengelolaan konflik.', 23),
(232, 'BK-22\r\nManajemen Resiko Bencana', 'Mampu menjelaskan manajemen pra bencana, saat bencana, dan setelah bencana.', 23);
