INSERT INTO `landasan` (`id_landasan`, `filosofis`, `psikologis`, `sosiologis`, `iptek`, `id_jurusan`) VALUES
(3, 'filosofis', 'prikologis', 'sosiologis', 'iptek', 16),
(5, 'Pengembangan kurikulum perlu dilandasi filosofi keilmuan terkait dengan falsafah perenialisme, esensialisme, progressivisme, dan pekrontruksionisme dalam Pendidikan Tinggi. Falsafah perenialisme merupakan salah satu landasan filosofis pengembangan kurikulum yang menekankan pada pembelajaran yang berfokus pada pengetahuan universal dan nilai-nilai yang tetap dalam masyarakat. Falsafah perenialisme ini memandang bahwa nilai-nilai seperti kebenaran, keadilan, dan kebaikan merupakan nilai-nilai yang universal dan abadi sehingga penting untuk mengajarkan dan membentuk karakter mahasiswa sesuai dengan nilai-nilai tersebut. Kurikulum yang dihasilkan dari falsafah perenialisme lebih menekankan pada pembelajaran yang terstruktur dan sistematis, di mana mahasiswa diberikan pengetahuan dasar yang kuat dalam berbagai bidang, seperti matematika, ilmu pengetahuan alam, dan humaniora (Ornstein, Levine, Gutek, & Vocke, 2017).\r\n\r\nFalsafah esensialisme merupakan landasan filosofis pengembangan kurikulum yang menekankan pada pengetahuan dan keterampilan yang esensial atau penting bagi kehidupan mahasiswa. Menurut Gutek (2017), kurikulum yang dihasilkan dari falsafah esensialisme lebih menekankan pada pembelajaran yang praktis dan relevan dengan kebutuhan mahasiswa dalam kehidupan nyata. Pendidikan yang diarahkan dengan falsafah esensialisme bertujuan untuk membentuk mahasiswa yang memiliki keterampilan dasar yang kuat dalam bidang seperti matematika, ilmu pengetahuan, dan bahasa sehingga mereka siap untuk memasuki dunia kerja atau melanjutkan pendidikan di jenjang yang lebih tinggi.\r\n\r\nFalsafah progressivisme dan pekonstruksionisme adalah landasan filosofis pengembangan kurikulum yang menekankan pada pembelajaran yang berfokus pada pengalaman dan pemecahan masalah. Menurut Elliot (2018), falsafah progressivisme mengajarkan bahwa siswa harus belajar melalui pengalaman langsung dan berpartisipasi aktif dalam proses pembelajaran. Sementara itu, falsafah pekonstruksionisme menekankan pada pembelajaran yang mengkritisi dan memperbaiki struktur sosial yang ada melalui analisis dan diskusi kritis tentang nilai-nilai dan kebijakan yang ada. Dalam pendidikan tinggi, landasan filosofis progressivisme dan pekonstruksionisme diaplikasikan dalam kurikulum yang menekankan pada pengalaman nyata, pemecahan masalah, dan kritis dalam analisis kebijakan dan masalah sosial yang ada di masyarakat (Banks, 2015).', '', 'Fondasi sosiologis kurikulum merupakan landasan filosofis pengembangan kurikulum yang menekankan pentingnya memahami hubungan antara individu, masyarakat, dan kebudayaan. Menurut Banks (2015), kurikulum yang dibangun dengan fondasi sosiologis menganggap bahwa pengetahuan, ketrampilan, dan nilai-nilai yang dianut oleh warga masyarakat tidak bisa dipisahkan dari konteks sosial, budaya, dan sejarah di mana mereka hidup. Oleh karena itu, kurikulum yang dikembangkan dengan fondasi sosiologis menekankan pada pengajaran tentang bagaimana individu berinteraksi dalam masyarakat, bagaimana kebudayaan mempengaruhi pola pikir dan perilaku individu, dan bagaimana nilai-nilai masyarakat tercermin dalam pembelajaran.\r\nAnalisis tentang saling kaitan antara individu, masyarakat, dan kebudayaan menjadi penting dalam pengembangan kurikulum. Hal ini karena kurikulum harus mempertimbangkan perbedaan sosial, budaya, dan ekonomi yang ada di masyarakat. Kurikulum yang dikembangkan dengan fondasi sosiologis memperhatikan keanekaragaman sosial dan budaya yang ada di masyarakat dan berusaha untuk mengintegrasikan nilai-nilai, pengetahuan, dan keterampilan yang penting bagi semua siswa. Dengan demikian, kurikulum tersebut dapat membantu siswa memahami bagaimana interaksi sosial dan budaya mempengaruhi pandangan dunia dan perilaku individu.\r\n\r\nPengetahuan, ketrampilan, dan nilai-nilai yang dianut oleh warga masyarakat menjadi bagian penting dalam pengembangan kurikulum. Menurut Banks (2015), kurikulum yang dikembangkan dengan fondasi sosiologis menekankan pentingnya mengintegrasikan pengetahuan, ketrampilan, dan nilai-nilai yang dianut oleh masyarakat dalam proses pembelajaran. Kurikulum tersebut juga menekankan pentingnya mengajarkan ketrampilan sosial dan keterampilan kritis, sehingga siswa dapat belajar berinteraksi dengan orang lain dari berbagai latar belakang dan memahami perspektif yang berbeda-beda. Dengan begitu, siswa dapat menjadi warga masyarakat yang terampil dalam beradaptasi dan bertahan hidup di tengah perbedaan sosial, budaya, dan ekonomi yang ada.', '', 18),
(6, 'Prodi Ilmu Komunikasi bertujuan untuk menghasilkan tiga profil lulusan yakni, \r\nDigital Public relations, Digital Marketing Communication, dan Journalism and Broadcast. Oleh karenanya, untuk mencapai profil lulusan tersebut, mahasiswa Prodi Ilmu Komunikasi diharapkan mencapai hasil belajar berupa kemampuan untuk mengidentifikasikan, menjelaskan, dan menggunakan teori-teori komunikasi yang relevan di bidang kajian komunikasi budaya, media, komunikasi digital, komunikasi politik dan komunikasi interpersonal. Selain itu, mahasiswa juga diharapkan mampu melakukan presentasi di depan publik dengan menggabungkan keterampilan public speaking, perencanaan komunikasi, komunikasi visual dan manajemen konten kreatif. Mahasiswa juga diharapkan mampu membuat produk komunikasi dalam beragam platform media serta mengaplikasikan analisis data kuantitatif dan data kualitatif dalam berbagai konteks penelitian komunikasi. Kemampuan lainnya yang juga harus dimiliki adalah melakukan kajian kritis terhadap perkembangan teknologi informasi dan komunikasi serta implikasinya terhadap masyarakat. Berdasarkan paradigma Kurikulum Merdeka, Kurikulum yang dirancang di Prodi Ilmu Komunikasi FISIP UPNVJT diharapkan dapat menjawab tantangan dinamika kebutuhan yang sesuai dengan kualifikasi Profil Lulusan Prodi Ilmu Komunikasi serta dapat memperkuat dasar keilmuan lulusan sehingga lebih berdaya dalam berkompetisi di dunia industri saat ini yang telah banyak terjadi disrupsi bidang pekerjaan tetapi juga melahirkan bidang pekerjaan baru. Oleh karena itu Prodi Ilmu komunikasi FISIP UPNV Jawa Timur telah merancang model pembelajaran yang berbasis kompetensi mahasiswa sehingga prinsip SKS dipahami sebagai waktu yang dibutuhkan oleh mahasiswa untuk mencapai kompetensi tertentu, dengan melalui suatu bentuk pembelajaran dan bahan kajian tertentu. Kurikulum Merdeka yang bertujuan untuk menjawab perubahan yang cepat di masyarakat menuntut perguruan tinggi untuk melakukan perubahan dalam model pembelajaran. Dalam pembelajarannya Prodi Ilmu Komunikasi FISIP UPNVJT merancang dan menyusun model pembelajaran yang berbasis pada Project-based learning, Problem-Based Learning dan Studi kasus untuk meningkatkan dan memperkuat skill lulusan.', '', '', '', 26),
(7, 'Secara filosofis pelaksanaan pendidikan di Program Studi Pariwisata mengacu pada UUD 1945 dan Pancasila. Hal ini mengacu pada Pasal 2 UU RI No.2 Tahun 1989 menetapkan bahwa pendidikan nasional berdasarkan pancasila dan UUD 1945, sedangkan Ketetapan MPR RI No. II/MPR/1978 tentang P4 menegaskan pula bahwa Pancasila adalah jiwa seluruh rakyat indonesia, kepribadian bangsa Indonesia, pandangan hidup bangsa Indonesia, dan dasar negara Indonesia.\r\n', '', '', 'Proses pembelajarannya Program Studi Pariwisata mengacu pada:\r\n1. Pengembangan ilmu pengetahuan dan teknologi, yang dilandasi nilai universal dan objektif dalam mencapai kebenaran ilmiah;\r\n2. penyelenggaraan tridharma perguruan tinggi yang dilandasi keimanan, kebebasan, dan tanggung jawab akademik serta sesanti Widya Mwat Yasa; dan\r\n3. peningkatan tata kelola UPN Veteran Jawa Timur yang baik dibuktikan dengan melaksanakan manajemen mandiri, modern, dan berkelanjutan. ', 28),
(8, 'Secara filosofis pelaksanaan pendidikan di Program Studi Bispro mengacu pada UUD 1945 dan Pancasila. Hal ini mengacu pada Pasal 2 UU RI\r\nNo.2 Tahun 1989 menetapkan bahwa pendidikan nasional berdasarkan pancasila dan UUD 1945, sedangkan Ketetapan MPR RI No. II/MPR/1978\r\ntentang P4 menegaskan pula bahwa Pancasila adalah jiwa seluruh\r\nrakyat indonesia, kepribadian bangsa Indonesia, pandangan hidup bangsa Indonesia, dan dasar negara Indonesia.\r\nSementara itu, dalam proses pembelajarannya Program Studi Bispro mengacu pada:\r\n1. Pengembangan ilmu pengetahuan dan teknologi, yang dilandasi nilai universal dan objektif dalam mencapai kebenaran ilmiah;\r\n2. penyelenggaraan tridharma perguruan tinggi yang dilandasi keimanan, kebebasan, dan tanggung jawab akademik serta sesanti Widya\r\nMwat Yasa; dan\r\n3. peningkatan tata kelola UPN Veteran Jawa Timur yang baik dibuktikan dengan melaksanakan manajemen mandiri, modern, dan\r\nberkelanjutan.', '', 'Program Studi Bispro Fakultas Ilmu Sosial dan Ilmu Politik UPN Veteran Jawa Timur diselenggarakan berdasarkan Keputusan Menteri\r\nPendidikan, Kebudayaan, Riset dan Teknologi Republik Indonesia Nomor : 76/D/OT/2023 tanggal 21 Maret 2023 tentang Pembukaan\r\nProgram Studi Bispro Program Sarjana Terapan Pada Universitas Pembangunan Nasional Veteran Jawa Timur di Surabaya. Program Studi\r\nBispro Fakultas Ilmu Sosial dan Ilmu Politik UPN Veteran Jawa Timur terakreditasi Baik berdasarkan\r\n2359/SK/BANPT/Ak.P/STr/VI/2023 tanggal 20 Juni 2023 tentang Pemenuhan Syarat Peringkat Akreditasi Program Studi Bahasa Inggris\r\nUntuk Komunikasi Bisnis Dan Profesional Pada Program Sarjana Terapan Universitas Pembangunan Nasional Veteran Jawa Timur, Kota\r\nSurabaya', 'Dalam proses pembelajarannya Program Studi Bispro mengacu pada:\r\n1. Pengembangan ilmu pengetahuan dan teknologi, yang dilandasi nilai universal dan objektif dalam mencapai kebenaran ilmiah;\r\n2. penyelenggaraan tridharma perguruan tinggi yang dilandasi keimanan, kebebasan, dan tanggung jawab akademik serta sesanti Widya\r\nMwat Yasa; dan\r\n3. peningkatan tata kelola UPN Veteran Jawa Timur yang baik dibuktikan dengan melaksanakan manajemen mandiri, modern, dan\r\nberkelanjutan.', 30),
(9, 'Secara filosofis pelaksanaan pendidkan di Program Studi Administrasi Bisnis mengacu pada UUD 1945 dan Pancasila. Hal ini mengacu pada Pasal 2 UU RI No.2 Tahun 1989 menetapkan bahwa pendidikan nasional berdasarkan pancasila dan UUD 1945, sedangkan Ketetapan MPR RI No. II/MPR/1978 tentang P4 menegaskan pula bahwa Pancasila adalah jiwa seluruh\r\nrakyat indonesia, kepribadian bangsa Indonesia, pandangan hidup bangsa Indonesia, dan dasar negara Indonesia.\r\nSementara itu, dalam proses pembelajarannya Program Studi Prodi Administrasi Bisnis mengacu pada:\r\n1.	Pengembangan ilmu pengetahuan dan teknologi, yang dilandasi nilai universal dan objektif dalam mencapai kebenaran ilmiah; \r\n2.	penyelenggaraan tridharma perguruan tinggi yang dilandasi keimanan, kebebasan, dan tanggung jawab akademik serta sesanti Widya Mwat Yasa; dan \r\n3.	peningkatan tata kelola UPN Veteran Jawa Timur yang baik dibuktikan dengan melaksanakan manajemen mandiri, modern, dan berkelanjutan. \r\n', '', '', '', 24),
(10, 'Prodi S-1 Linguistik Indonesia bertujuan mengembangkan calon sarjana dengan kompetensi linguistik berwawasan internasional pada era revolusi industri 5.0. Di samping itu, mahasiswa yang telah  lulus memiliki kompetensi khusus sebagai seorang linguis (ahli bahasa), peneliti linguistik, dan praktisi linguistik Indonesia yang dinamis terhadap perkembangan ilmu pengetahuan dan kemajuan teknologi. \r\nAdapaun profil lulusan S-1 Linguistik Indonesia Universitas Pembangunan Nasional Veteran Jawa Timur dapat memiliki peran di bidang keahlian atau bidang kerja meliputi: 1) ahli bahasa pada tata naskah di perusahaan; 2) saksi ahli bahasa di pengadilan/kepolisian; 3) praktisi pada bidang medis khususnya pada terapi wicara, afasia, demensia, disleksia, atau masalah kebahasaan lainnya; 4) praktisi linguistik di badan bahasa maupun balai bahasa; 5) editor/penyunting buku atau naskah kebahasaan; 6) jurnalis/wartawan; 7) presenter/Penyiar baik di televisi ataupun radio; 8) pelaku industri perfilman seperti sutradara, produser,   skenario, dan aktor/aktris yang memahami literasi digital; 9) Pengajar BIPA (Bahasa Indonesia bagi Penutur Asing) dan  10) penerjemah/juru Bahasa.\r\n\r\nSementara itu, pada aspek kurikulum Prodi S-1 Linguistik Indonesia ini memiliki kekhasan dengan menawarkan beberapa mata kuliah penciri seperti linguistik forensik, linguistik klinis, linguistik komputasional, matematika bahasa, linguistik edukasional, bahasa dan kekuasaan, bahasa dan gender, bahasa dan musik, lanskap linguistik, literasi digital, serta penerjemahan dan kejurubahasaan. berdasarkan mata kuliah tersebut, dapat membuka peluang bagi mahasiswa dan dosen untuk berkolaborasi dengan praktisi lain yang terkait. Adanya beberapa mata kuliah tersebut dapat dilihat sebagai satu upaya untuk mengantarkan mahasiswa menjadi lulusan yang inovatif, adaptif, dan responsif terhadap tantangan global.\r\nOleh sebab itu, Kurikulum Merdeka saat ini bertujuan untuk menjawab perubahan yang cepat di masyarakat menuntut perguruan tinggi untuk melakukan perubahan dalam model pembelajaran. Dalam pembelajarannya Prodi Linguistik Indonesia FISIP UPNVJT merancang dan menyusun model pembelajaran yang berbasis pada Project-based learning, Problem- based Learning dan Studi kasus untuk meningkatkan dan memperkuat skill lulusan. ', 'Aspek kurikulum Prodi S-1 Linguistik Indonesia ini memiliki kekhasan dengan menawarkan beberapa mata kuliah penciri seperti linguistik forensik, linguistik klinis, linguistik komputasional, matematika bahasa, linguistik edukasional, bahasa dan kekuasaan, bahasa dan gender, bahasa dan musik, lanskap linguistik, literasi digital, serta penerjemahan dan kejurubahasaan. berdasarkan mata kuliah tersebut, dapat membuka peluang bagi mahasiswa dan dosen untuk berkolaborasi dengan praktisi lain yang terkait. Adanya beberapa mata kuliah tersebut dapat dilihat sebagai satu upaya untuk mengantarkan mahasiswa menjadi lulusan yang inovatif, adaptif, dan responsif terhadap tantangan global.\r\nOleh sebab itu, Kurikulum Merdeka saat ini bertujuan untuk menjawab perubahan yang cepat di masyarakat menuntut perguruan tinggi untuk melakukan perubahan dalam model pembelajaran. Dalam pembelajarannya Prodi Linguistik Indonesia FISIP UPNVJT merancang dan menyusun model pembelajaran yang berbasis pada Project-based learning, Problem- based Learning dan Studi kasus untuk meningkatkan dan memperkuat skill lulusan. \r\n\r\n', 'Program Studi S-1 Linguistik Indonesia UPN Veteran Jawa Timur terakreditasi BAIK. Hal ini berdasarkan Surat Keputusan Direktur Dewan Eksekutif Badan Akreditasi Nasional Perguruan Tinggi Nomor: 1807/SK/BAN-PT/Ak.P/S/V/2023 tentang Pemenuhan Syarat Peringkat Akreditasi Program Studi Linguistik Indonesia pada Program Sarjana Universitas Pembangunan Nasional Veteran Jawa Timur, Kota Surabaya oleh Direktur Dewan Eksekutif Badan Akreditasi Nasional Perguruan Tinggi pada16 Mei 2023.', 'Saat ini diketahui bahwa arus informasi, teknologi, dan komunkasi berkembang cukup pesat. Dapat dikatakan bahwa saai ini masyarakat telah memasuki dunia digital yang mengubah pola kehidupan masyarakat dan semua berlangsung cepat. Oleh sebab itu, profil lulusan S-1 Linguistik Indonesia Universitas Pembangunan Nasional Veteran Jawa Timur diharapkan mampu tanggap dengan kondisi tersebut. Lulusan harus mampu dan siap meyebar  ke segala lini. Dengan bekal soft skill dan karakter bela negara lulusan harus cakap, inovatif, adaptif, dan responsif terhadap tantangan global.', 29),
(11, 'Secara filosofis pelaksanaan pendiidkan di Program Studi Administrasi Publik mengacu pada UUD 1945 dan Pancasila. Hal ini mengacu pada Pasal 2 UU RI No.2 Tahun 1989 menetapkan bahwa pendidikan nasional berdasarkan pancasila dan UUD 1945, sedangkan Ketetapan MPR RI No. II/MPR/1978 tentang P4 menegaskan pula bahwa Pancasila adalah jiwa seluruh\r\nrakyat indonesia, kepribadian bangsa Indonesia, pandangan hidup bangsa Indonesia, dan dasar negara Indonesia.\r\nSementara itu, dalam proses pembelajarannya Program Studi Administrasi Publik mengacu pada:\r\nPengembangan ilmu pengetahuan dan teknologi, yang dilandasi nilai universal dan objektif dalam mencapai kebenaran ilmiah;\r\npenyelenggaraan tridharma perguruan tinggi yang dilandasi keimanan, kebebasan, dan tanggung jawab akademik serta sesanti Widya Mwat Yasa; dan\r\npeningkatan tata kelola UPN Veteran Jawa Timur yang baik dibuktikan dengan melaksanakan manajemen mandiri, modern, dan berkelanjutan.', '', '', '', 23);
