INSERT INTO `profil_lulusan` (`id_lulusan`, `kode_lulusan`, `profil`, `deskripsi`, `id_jurusan`) VALUES
(14, 'PL01', 'Analisis Data', 'aalisis data yang ...', 16),
(15, 'PL02', 'Analisis Kimia', 'seorang analisi yang', 16),
(16, 'PL03', 'Asisten Lab', 'seorang asisten lab yang', 16),
(17, 'PL04', 'Reaksi Kimia', 'seorang yang', 16),
(18, 'PIF001', 'Programer', 'bkasjbaksagjsaks\r\n', 17),
(20, 'PIF002', 'Data Analyst', 'data anlusasjaiksajns', 17),
(21, 'PL-1', 'Data Analyst', 'Lulusan yang memiliki kemampuan untuk menganalisis, mengaplikasikan teknik analisis data, dan mengkomunikasikan hasil temuan dengan menggunakan perangkat lunak untuk menyelesaikan permasalahan di bidang analisis data', 18),
(22, 'PL-2', 'Data Engineer', 'Lulusan yang memiliki kemampuan merancang, mengintegrasikan, dan mengimplementasikan arsitektur manajemen basis data untuk kebutuhan pemrosesan data berskala besar', 18),
(23, 'PL-3', 'Data Scientist', 'Lulusan yang menguasai konsep big data, mengembangkan dan menyebarkan model prediktif  berbasis kecerdasan buatan,  serta mengkomunikasikan hasil temuan dalam menyelesaikan permasalahan di berbagai bidang dan domain keilmuan', 18),
(24, 'PL-4', 'Intelligent System Developer', 'Lulusan yang memiliki kemampuan dalam merancang, mengembangkan, dan mengimplementasikan sistem berbasis kecerdasan buatan ke dalam bentuk suatu aplikasi sistem cerdas', 18),
(25, 'PL-5', 'Machine Learning Engineer', 'Lulusan yang memiliki kemampuan dalam merancang, membangun, dan mengkombinasikan algoritma dan model statistik dalam melakukan identifikasi pola, pengambilan keputusan, dan pembuatan model prediksi berdasarkan data yang diberikan', 18),
(26, 'PL-6', 'Akademisi', 'Lulusan yang memiliki kemampuan merancang, melaksanakan, mengembangkan ilmu pengetahuan, mendokumentasikan, dan mendesiminasikan hasil penelitian ilmiah dalam bidang sains data', 18),
(30, 'PL-1', 'Media Planner Creative dan Digital STrategist', 'Profesi yang bertugas untuk mengintegrasikan aset digital dan membuat perencanaan media untuk membuat strategi kampanye pemasaran untuk perusahaan.', 26),
(31, 'PL-2', 'Public Relations Officer', 'Profesi PRO bertugas untuk menjaga hubungan baik antara \r\nperusahaan atau organisasi dengan publik untuk \r\nmembangun reputasi perusahaan melalui penysunan dan \r\npengembangkan strategi dan program komunikasi serta \r\nmenyusun promosi.', 26),
(32, 'PL-3', 'Jurnalis', 'Profesi yang bekerja di media massa/online dan bertanggung jawab untuk menyusun dan menyampaikan berita kepada pembaca.', 26),
(33, 'PL-4', 'Akademisi', 'Pendidik profesional dan ilmuwan dengan tugas utama mentransformasikan, mengembangkan, dan menyebarluaskan ilmu pengetahuan, teknologi, dan seni melalui pendidikan, penelitian, dan pengabdian kepada masyarakat.', 26),
(34, 'PL-5', 'Peneliti', 'Profesi yang bekerja dengan fokus menggunakan metode ilmiah untuk mengembangkan ilmu pengetahuan atau mencari solusi permasalahan dengan merencanakan penelitian, menelusuri kepustakaan, mengumpulkan data, mengolah data, menulis hasil penelitian, dan mempresentasikan hasil penemuan.', 26),
(35, 'PL-6', 'Wirausaha Industri Kreatif', 'Individu yang memiliki kreativitas dan inovatif yang mendirikan, mengelola, dan mengembangkan bisnisberbasis industri kreatif atau usaha dengan tujuan untuk menciptakan nilai tambah, menghasilkan keuntungan, dan mengelola risiko.', 26),
(36, 'PL-1', 'Pengelola Destinasi Ekowisata', 'Pengelola Destinasi Wisata secara konkret dapat diterjemahkan dalam beberapa profesi, yaitu manajer/pimpinan resort/destinasi wisata dan pimpinan staf lainnya pengelola resort/destinasi wisata, pimpinan kelompok sadar wisata (pokdarwis), top level/pimpinan tenaga kerja perhotelan/akomodasi wisata, vlogger, pengelola utama cottage dan jasa kepariwisataan lainnya, serta menjadi pengusaha di bidang pariwisata.', 28),
(37, 'PL-2', 'Tenaga Ahli Ekowisata', 'Tenaga Ahli Ekowisata diterjemahkan menjadi dua, yakni konsultan bidang ekowisata baik yang bekerja atas nama pemerintah maupun swasta, dan instruktur lapangan bidang ekowisata yang bisa bekerja atas nama pemerintah maupun swasta.', 28),
(38, 'PL-3', 'Birokrat', 'Birokrat diartikan sebagai pengambil kebijakan dalam rangka pengembangan kepariwisataan baik pada tingkat nasional di kementerian pariwisata ataupun pada level daerah di dinas pariwisata', 28),
(39, 'PL-4', 'Akademisi', 'Akademisi diartikan sebagai tenaga pengajar baik secara formal di lingkup pendidikan SMK Pariwisata ataupun secara nonformal dalam hal pemberian pendidikan dan pelatihan bagi para pengelola wisata.', 28),
(40, 'PL-5', 'Kewirausahaan', 'Kewirausahaan diartikan sebagai pengusaha di bidang pariwisata baik dalam bidang tour travel, industri kreatif, pengembangan destinasi ataupun akomodasi, serta penyelenggara event.', 28),
(41, '1', 'Editor/content writer/creator,', 'lulusan yang memiliki kemampuan untuk berpikir kritis dan analitis terhadap fenomena yang sedang\r\nterjadi dan menuangkannya dalam bentuk tulisan. Menghasilkan karya tulis yang dapat membangun\r\ndan meningkatkan kualitas literasi masyarakat.', 30),
(42, '2', 'Edupreneur/Entrepreneur', 'lulusan yang memiliki kemampuan dalam ilmu kewirausahaan sehingga mampu untuk mendirikan\r\nsuatu bidang usaha yang berbasis pada pendidikan kemampuan berbahasa inggris.', 30),
(43, '3', 'Staff of export & import, administration and marketing office', 'lulusan yang memiliki kemampuan dalam ranah bisnis ekspor, impor dan industri dan mampu\r\nberkomunikasi menggunakan bahasa Inggris secara baik dan benar sehingga bisa menjadi bagian dari\r\ntenaga kerja ahli di suatu perusahaan maupun institusi.', 30),
(44, '4', 'Public relation officer', 'lulusan memiliki kemampuan dan keahlian dalam berkomunikasi secara profesional terutama ketika berkomunikasi menggunakan bahasa Inggris.', 30),
(45, '5', 'Jurnalis', 'lulusan yang menguasai konsep berkomunikasi baik secara verbal maupun non verbal dalam bahasa\r\nInggris. Menyajikan suatu informasi kepada pembaca dengan tata bahasa yang baik dan bagus sehingga dapat diterima dan dipahami oleh pembaca.', 30),
(46, '6', 'Translator/interpreter', 'lulusan memiliki kemampuan baik verbal maupun non verbal dalam berkomunikasi menggunakan bahasa Inggris yang baik dan benar sesuai dengan kaidah keilmuan.', 30),
(47, '7', 'Tour Guide dan Travel Agent', 'lulusan memiliki kemampuan dan kecakapan dalam berkomunikasi menggunakan bahasa Inggris\r\nsehingga memungkinkan mereka dalam berkomunikasi dengan wisatawan asing sekaligus memperkenalkan pariwisata Indonesia ke dunia internasional.', 30),
(48, 'PL-1', 'Digital Entrepreneur', 'Mampu merencanakan, membuat, menganalisis, dan mengembangkan model Bisnis bidang jasa, perdagangan, manufaktur, industri kreatif dan Prodi Administrasi Bisnis. Mengaplikasikan konsep wirausaha dibidang jasa, perdagangan, manufaktur, industri kreatif dan Prodi Administrasi Bisnis. Bernegosiasi, berkomunikasi secara efektif dan beretika untuk menjalin kerjasama dalam pengembangan usaha, serta memanfaatkan teknologi dan informasi dalam pengembangan usaha.', 24),
(49, 'PL-2', 'Human Resource Specialist', 'Mampu membuat perencanaan, alokasi sumber daya, menggerakan serta mengevaluasi dalam pengambilan keputusan strategis. Mengkaji dan menganalisis lingkungan bisnis dalam menyusun dan mengembangkan strategi bisnis. Membuat design pekerjaan yang efektif dan efisien dalam pencapaian perusahaan. Serta menguasai dan memahami sistem informasi dan manajemen dalam pengambilan keputusan strategis.', 24),
(50, 'PL-3', 'Digital Marketer', 'Mampu membantu menyusun perencanaan, alokasi sumber daya dalam pengambilan keputusan pemasaran strategis. Bertanggungjawab atas pekerjaan yang telah diberikan. Berkomunikasi secara efektif dan membangun team work dengan sesama pekerja. Bernegosiasi dan berkomunikasi secara efektif serta mampu menjalin kerjasama.', 24),
(51, 'PL-4', 'Financial Analyst', 'Mampu membuat dan menganalisis pelaporan keuangan berbagai industri. Bernegosiasi dan berkomunikasi secara efektif serta mampu menjalin kerjasama. Berfikir kritis, analitis dan konstruktif dalam menghasilkan solusi dan rekomendasi dalam bidang keuangan. Mendesiminiskan gagasan ilmiah dibidang ilmu administrasi bisnis yang dapat diakses oleh masyarakat akademis dan umum. Serta menggunakan dan memahami teknologi dan informasi bidang keuangan.', 24),
(52, 'PL-5', 'Information Management System Analyst', 'Mampu memahami perangkat keras, perangkat lunak, jaringan, dan sistem operasi, serta mengikuti perkembangan tekologi terkini. Menganalisis masalah dan  merumuskan solusi yang efektif. Memahami struktur data, manajemen database, dan teknik analisis data, serta berkomunikasi efektif dan bekerja dengan baik dalam tim.', 24),
(53, 'PL-1', 'Praktisi Linguistik ', 'Profesi yang berkontribusi sebagai PNS di badan bahasa dan balai bahasa.', 29),
(54, 'PL-2', 'Pengajar BIPA ', 'Profesi yang memeiliki skill mengajar Bahasa Indonesia bagi Penutur Asing di berbaga Lembaga kursus/sekolah/universitas baik di tingkat nasional maupun internasional.', 29),
(55, 'PL-3', 'Jurnalis/Presenter ', 'Profesi	yang   bekerja   di	media massa/online dan bertanggung jawab untuk menyusun dan menyampaikan berita kepada pembaca.\r\n', 29),
(56, 'PL-4', 'Editor dan Penerjemah ', 'Sebagai editor/penyunting naskah kebahasaan dan juga penerjemah dengan memperhatikan perkembangan ilmu kebahasaan seperti ejaan resmi/baku  Bahasa Indonesia yang benar', 29),
(57, 'PL-5', 'Wirausaha industri kreatif ', 'Profesi yang mengutamakan skill wirausaha kreatif dan inovatif yang   mendirikan, mengelola, dan mengembangkan bisnis berbasis industri kreatif dengan tujuan untuk menciptakan nilai tambah, menghasilkan keuntungan, dan mengelola risiko yang adaptif mengikuti perkembangan zaman.\r\n', 29),
(58, 'PL-6', 'Akademisi', 'Profesi sebagai pendidik profesional dan ilmuwan dengan tugas utama mentransformasikan, mengembangkan, dan menyebarluaskan ilmu pengetahuan, teknologi, dan seni melalui pendidikan, penelitian, dan pengabdian kepada masyarakat dengan mengedepankan karakter bela negara.', 29),
(59, 'PL-1', 'Analis Kebijakan dan Regulasi', 'Pegawai Negeri Sipil (PNS) yang bertugas, tanggung jawab dan memiliki wewenang untuk melaksanakan kajian dan analisis kebijakan dalam lingkungan instansi pusat dan daerah', 23),
(60, 'PL-2', 'Profesional Organisasi Non-Profit', 'Tenaga Ahli yang memiliki kemampuan untuk memperkuat strategi reformasi administrasi dan manajemen publik, Memiliki kemampuan untuk bekerja sama atau bekerja sama dalam kelompok untuk menciptakan inovasi dalam pemecahan masalah publik', 23),
(61, 'PL-3', 'Manajer Sumber Daya Manusia', 'Mampu mengembangkan kebijakan dan keputusan manajerial di organisasi publik', 23);
