INSERT INTO `skl` (`id_skl`, `kode_skl`, `skl`, `id_cpl`, `id_jurusan`) VALUES
(5, 'SKL 1', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.', 39, 16),
(41, 'CPL01', 'Mampu menunjukkan sikap menjadi insan yang bertaqwa, bertanggung jawab, mandiri dan bekerjasama, sesuai dengan nilai-nilai bela negara, cinta tanah air, serta kepedulian terhadap masyarakat dan lingkungan', 30, 18),
(42, 'CPL02', 'Mampu menganalisis dan mengaplikasikan teknik analisis data dengan menggunakan perangkat lunak untuk menyelesaikan permasalahan di bidang analisis data', 31, 18),
(43, 'CPL03', 'Mampu merancang, mengintegrasikan, dan mengimplementasikan arsitektur manajemen basis data untuk kebutuhan pemrosesan data berskala besar', 32, 18),
(44, 'CPL04', 'Mampu menguasai konsep big data dan mengembangkan model prediktif berbasis kecerdasan buatan dalam menyelesaikan permasalahan di berbagai bidang dan domain keilmuan', 33, 18),
(45, 'CPL05', 'Mampu merancang, mengembangkan, dan mengimplementasikan sistem berbasis kecerdasan buatan ke dalam bentuk suatu aplikasi sistem cerdas', 34, 18),
(46, 'CPL06', 'Mampu merancang, membangun, dan mengkombinasikan algoritma dan model statistik dalam melakukan identifikasi pola, pengambilan keputusan, dan pembuatan model prediksi berdasarkan data yang diberikan', 35, 18),
(47, 'CPL07', 'Mampu merancang, melaksanakan, mengembangkan ilmu pengetahuan, dan mendokumentasikan penelitian ilmiah dalam bidang sains data', 36, 18),
(48, 'CPL08', 'Mampu mengkomunikasikan informasi dalam bentuk narasi serta visualisasi dari hasil temuan dan wawasan data', 37, 18),
(49, 'CPL09', 'Mampu menguasai konsep matematika, statistika, dan dasar ilmu komputer untuk memperkuat landasan ilmiah keilmuan sains data', 38, 18),
(50, 'CPL10', 'Mampu membangun pemrograman, kerangka kerja pengembangan, dan penyebaran (deployment) perangkat lunak berbasis kecerdasan buatan', 48, 18),
(51, 'CPL11', 'Mampu memiliki keterampilan interpersonal dan profesional dengan menerapkan nilai-nilai etika dalam profesi sains data', 49, 18),
(52, 'SKL 1', 'Keterampilan Komunikasi: Lulusan diharapkan memiliki kemampuan komunikasi yang efektif, baik secara lisan maupun tertulis, dalam berbagai konteks dan media komunikasi.', 53, 26),
(53, 'SKL 2', 'Penguasaan Teori Komunikasi: Lulusan diharapkan memahami berbagai teori komunikasi serta mampu menerapkan teori-teori tersebut dalam menganalisis dan memecahkan masalah komunikasi.', 52, 26),
(54, 'SKL 3', 'Keterampilan Penelitian: Lulusan diharapkan memiliki kemampuan untuk merancang dan melaksanakan penelitian dalam bidang komunikasi, termasuk pengumpulan, analisis, dan interpretasi data.', 56, 26),
(55, 'SKL 4', 'Keterampilan Teknologi Komunikasi: Lulusan diharapkan mampu menggunakan teknologi komunikasi modern secara efektif, termasuk penggunaan perangkat lunak dan platform digital.', 61, 26),
(56, 'SKL 5', 'Kemampuan Berpikir Kritis : Lulusan diharapkan memiliki kemampuan berpikir kritis dalam menganalisis isu-isu komunikasi, mengevaluasi informasi, dan mengambil keputusan yang tepat.', 62, 26),
(57, 'SKL 6', 'Kemampuan Beradaptasi: Lulusan diharapkan mampu beradaptasi dengan perubahan dalam dunia komunikasi yang dinamis, termasuk perkembangan teknologi dan tren komunikasi terkini.\r\n', 59, 26),
(58, 'SKL 7', 'Kemampuan Kerjasama: Lulusan diharapkan mampu bekerja secara efektif dalam tim dan berkolaborasi dengan berbagai pihak dalam konteks komunikasi organisasi atau masyarakat.', 50, 26),
(59, 'SKL 8', 'Keterampilan Manajemen Waktu dan Proyek: Lulusan diharapkan memiliki kemampuan untuk mengelola waktu dan proyek dengan baik dalam rangka mencapai tujuan komunikasi yang ditetapkan.\r\n', 58, 26),
(60, 'SKL 9', 'Etika Profesional: Lulusan diharapkan memiliki kesadaran akan etika komunikasi dan perilaku profesional dalam berbagai konteks komunikasi.\r\n', 51, 26),
(61, 'SKL 10', 'Keterampilan Presentasi: Lulusan diharapkan mampu melakukan presentasi yang efektif dan meyakinkan di depan publik, baik secara lisan maupun visual.', 58, 26),
(62, 'CPL-1', 'Menunjukkan sikap bertakwa kepada Tuhan Yang Maha Esa, menjunjung tinggi nilai-nilai kemanusiaan, kepekaan dan kepedulian sosial, nilai-nilai belanegara, taat hukum dan disiplin dalam kehidupan bermasyarakat dan bernegara', 65, 28),
(63, 'CPL-2', 'Berkontribusi dalam peningkatan mutu kehidupan bermasyarakat, berbangsa, bernegara, dan kemajuan peradaban berdasarkan Pancasila, serta menghargai keanekaragaman budaya, pandangan, agama, dan kepercayaan, serta pendapat atau temuan orisinal orang lain', 66, 28),
(64, 'CPL-3', 'Menunjukkan sikap bertanggung jawab atas pekerjaan di bidang keahliannya secara mandiri maupun kelompok dengan menginternalisasi semangat kemandirian, kejuangan, dan kewirausahaan serta Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega,  sejawat baik di dalam maupun di luar lembaganya', 67, 28),
(65, 'CPL-4', 'Menginternalisasikan nilai-nilai integritas, norma, dan etika akademik dan sikap responsive, terpercaya, professional sesuai dengan Global Code of Ethics for Tourism yang berkepribadian Indonesia dalam menjalankan tugasnya', 68, 28),
(66, 'CPL-5', 'Menguasai konsep teoritis pariwisata secara mendalam, meliputi: Sistem pariwisata dan fenomena pariwisata; Pembangunan pariwisata berkelanjutan; Sumber daya, infrastruktur, dan daya tarik pariwisata; Tipologi dan perilaku wisatawan;  Siklus hidup pariwisata; Peraturan perundangan kepariwisataan; Antropologi budaya wisatawan; Manajemen operasional (perencanaan, pelaksanaan, pengarahan, pemantauan, evaluasi, dan pengendalian) organisasi layanan jasa dan produk pariwisata; Manajemen SDM, keuangan, logistik organisasi layanan jasa dan produk pariwisata; dan Manajemen pemasaran layanan jasa dan produk pariwisata', 69, 28),
(67, 'CPL-6', 'Menguasai konsep dan metode: Analisis kesenjangan kebijakan; Penetapan standar kualitas layanan produk dan jasa pariwisata;  Resiliensi diri pada lingkungan kerja untuk internal organisasi kepariwisataan dan dalam penanganan klien; Penilaian daya Tarik wisata; Dampak pembangunan pariwisata', 70, 28),
(68, 'CPL-7', 'Menguasai konsep, prinsip, dan teknik: Pemasaran layanan jasa dan produk pariwisata; Pedagogi budaya dan masyarakat; Komunikasi lisan dan tulisan dalam bahasa Indonesia, minimal satu bahasa internasional atau minimal satu bahasa asing lainnya; Presentasi, negosiasi, dan teknik komunikasi dalam mengomunikasikan ide, kebijakan, solusi alternatif dan rekomendasi; Analisis laporan dan rasio keuangan minimal tingkat pengembalian investasi (ROI), nilai bersih sekarang (NPV), nilai bersih yang akan datang (FV) dan tingkat pengembalian investasi (IRR); Layanan prima; dan Keselamatan, kesehatan kerja dan lingkungan (K3L) dalam penyediaan layanan jasa dan produk pariwisata termasuk Bantuan Hidup Dasar', 71, 28),
(69, 'CPL-8', 'Menguasai pengetahuan faktual tentang indeks daya saing pariwisata. Menguasai konsep perencanaan pariwisata dengan tetap memperhatikan aspek konservasi dan lingkungan', 72, 28),
(70, 'CPL-9', 'Mampu menerapkan pemikiran logis, kritis, sistematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang dituangkan dalam mpu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi', 73, 28),
(71, 'CPL-10', 'Mampu mengambil keputusan secara tepat dalam konteks penyelesaian masalah di bidang keahliannya, berdasarkan hasil analisis informasi dan data serta mampu melakukan proses evaluasi diri', 74, 28),
(72, 'CPL-11', 'Mampu mendokumentasikan, menyimpan, mengamankan, dan menemukan kembali data untuk menjamin kesahihan dan mencegah plagiasi berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan, desain atau kritik seni', 75, 28),
(73, 'CPL-12', 'Menguasai teknologi informasi dan minimal satu bahasa internasional untuk komunikasi lisan dan tulis dalam konteks pengembangan keilmuan dan implementasi bidang keahlian', 76, 28),
(74, 'CPL-13', 'Mampu mengidentifikasi, menganalisis, mengevaluasi dan memberikan rekomendasi perbaikan efektivitas interaksi antar pemangku kepentingan (pemerintah, masyarakat, dunia usaha dan industri) pada aspek kepariwisataan dalam satu destinasi skala tapak dan skala kecil dan menengah, menggunakan metode analisis dampak, analisis kekuatan, kelemahan, peluang, dan ancaman, serta analisis berbasis hirarki dan kinerja', 77, 28),
(75, 'CPL-14', 'Mampu mengidentifikasi dan menganalisis faktor-faktor yang berperan dalam efektivitas implementasi kebijakan kementerian yang membidangi kepariwisataan', 78, 28),
(76, 'CPL-15', 'Mampu meningkatkan kinerja organisasi usaha-usaha bidang kepariwisataan pada skala kecil dan menengah, meliputi kemampuan: bidang pelayanan prima, penyedia jasa pariwisata, promosi dan pemasaran, manajemen keuangan, K3L', 79, 28),
(77, 'CPL-16', 'Mampu melaksanakan kegiatan konservasi dan edukasi yang sesuai dengan prinsip-prinsip ekowisata dan pariwisata berkelanjutan untuk mempertahankan kesejahteraan entitas lokal', 80, 28),
(78, 'CPL-1', 'S1  Bertakwa  kepada Tuhan  Yang  Maha  Esa  dan  \r\nMenjunjung tinggi nilai kemanusiaan dalam menjalankan tugas berdasarkan agama, moral dan etika.\r\n', 84, 24),
(79, 'CPL-2', 'S2  Dapat berkontribusi dan berperan  dalam \r\n       peningkatan mutu kehidupan bermasyarakat,    \r\n       berbangsa,   dan   bernegara  berdasarkan Pancasila\r\n', 85, 24),
(80, 'CPL-3', 'S3 Menginternalisasi nilai nilai , norma, Etika dan sikap \r\n          professional Dan bertanggung jawab atas pekerjaan \r\n         di bidang organisasi dan bisnis.\r\n', 86, 24),
(81, 'CPL-4 	', 'S4    Menunjukkan  sikap saling  percaya, saling  \r\n        melayani,  dan menjunjung tinggi kesetaraan dalam \r\n        profesi\r\n', 87, 24),
(82, 'CPL-5', 'KU1 - Mampu menerapkan pemikiran logis, kritis,  \r\nsistematis, dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang memperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang keahliannya; berdasarkan kaidah, tata cara dan etika ilmiah dalam rangka menghasilkan solusi, gagasan, desain atau kritik seni\r\n', 88, 24),
(83, 'CPL-6', 'KU2 - Mampu menyusun deskripsi saintifik hasil kajian tersebut di atas dalam bentuk skripsi atau laporan tugas akhir, dan mengunggahnya dalam laman perguruan tinggi;', 89, 24),
(84, 'CPL-7', 'KU3 - Mampu memelihara dan mengembangkan jaringan kerja dengan pembimbing, kolega, sejawat baik di dalam maupun di luar lembaganya.', 90, 24),
(85, 'CPL-8', 'KU4 - Mampu bertanggung jawab atas pencapaian hasil kerja kelompok maupun mandiri dan melakukan supervisi serta evaluasi terhadap penyelesaian pekerjaan yang ditugaskan kepada pekerja yang berada di bawah tanggung jawabnya;', 91, 24),
(86, 'CPL-9', 'KU5 - Mampu menggunakan bahasa internasional untuk komunikasi lisan dan tertulis', 92, 24),
(87, 'CPL-10', 'KU6 - Mampu melakukan pemberdayaan masyarakat di bidang sosial dan ekonomi', 93, 24),
(88, 'CPL-11', 'KK1 - Memiliki kemampuan dalam menangkap peluang usaha potensial yang kreatif, inovatif, dan memiliki nilai tambah yang bermanfaat untuk menciptakan lapangan kerja yang berhasil guna bagi masyarakat.', 94, 24),
(89, 'CPL-12', 'KK2 - Memiliki kemampuan manajerial dalam team work proses perencanaan,pengelolaan, pengawasan dan pengendalian bidang jasa, perdagangan dan manufaktur', 95, 24),
(90, 'CPL-13', 'KK3 - Memiliki kompetensi dalam mengembangkan teknik marketing secara digital dan non digital melalui pengembangan produk, keahlian dalam menentukan harga jual, keahlian dalam mempromosikan produk, keahlian dalam pendistribusian produk,  pengelolaan sumberdaya manusia, analisis finansial serta teknik pengadministrasian.', 96, 24),
(91, 'CPL-14', 'KK4 - Mampu merancang dan melaksanakan penelitian untuk menghasilkan alternatif penyelesaian masalah di bidang administrasi bisnis', 97, 24),
(92, 'CPL-15', 'KK5 - Mampu melakukan pendampingan melalui proses analisis, evaluasi, dan menafsirkan informasi bisnis kepada klien sampai memiliki kemampuan teknis untuk mengembangkan bisnisnya.', 98, 24),
(93, 'CPL-16', 'KK6 - Mampu memanfaatkan teknologi informasi dan mengelola big data dalam kegiatan pengembangan bisnis dan membuat keputusan', 99, 24),
(94, 'CPL-17', 'P1 - Menguasai serta memahami pengetahuan konsep-konsep entrepreneur dalam bidang jasa, perdagangan dan manufaktur secara professional dengan berlandaskan jiwa bela negara', 100, 24),
(95, 'CPL-18', 'P2 - Menguasai dan memahami teknik perencanaan, pengalokasian, pengawasan  serta pengambilan keputusan strategis dalam pengelolaan organisasi yang beradaptasi dengan perubahan lingkungan serta teknologi ', 101, 24),
(96, 'CPL-19', 'P3 - Memiliki kemampuan dalam bidang inti administrasi bisnis khususnya marketing, financial, human resource development, opersioanal baik secara konseptual maupun teknis yang menunjang serta pengetahuan terbaru dalam berbagai bidang yang lebih terspesialisasi dalam administrasi bisnis untuk pengambilan keputusan strategis ', 102, 24),
(97, 'CPL-20', 'P4 - Menguasai dan memahami teknik analisis dalam pengembangan ilmu administrasi bisnis secara profesional', 103, 24),
(98, 'CPL-21', 'P5 - Memiliki pengetahuan dan pemahaman terkait wawasan kebangsaan dan bela negara', 104, 24),
(99, 'CPL-1', 'S1. Mampu menunjukkan sikap religius yang mencerminkan: ketakwaan kepada Tuhan Yang Maha Esa dan menjunjung tinggi nilai kemanusiaan\r\nberdasarkan norma agama, moral, dan etika.', 121, 23),
(100, 'CPL-2', 'S2. Menginternalisasi nilai, norma, dan etika akademik serta berperan sebagai\r\nwarga negara yang taat hukum,memiliki sikap nasionalisme, rasa tanggung jawab pada negara dan bangsa', 122, 23),
(101, 'CPL-3', '\r\nS3. Menghargai keanekaragaman budaya, agama, dan kepercayaan serta berkontribusi dalam peningkatan mutu kehidupan berbangsa dan bernegara berdasarkan pancasila dan berkarakter bela negara.', 123, 23),
(102, 'CPL-4', '\r\nS4. Menunjukan sikap bertanggungjawab atas pekerjaan dibidang keahliannya dengan semangat kemandirian,kejuangan, dan kewirausahaan yang\r\nmenjunjung tinggi sikap profesionalitas', 124, 23),
(103, 'CPL-5', 'P1. Menguasai konsep teoritis administrasi, organisasi, birokrasi, kebijakan\r\npublik, pelayanan publik, perilaku organisasi, keuangan negara, reformasi administrasi, dan governansi publik.', 149, 23),
(104, 'CPL-6', 'P2. Menguasai prinsip-prinsip umum ilmu politik, ilmu sosial, ilmu ekonomi makro, hukum administrasi negara, manjemen risiko, dan etika administrasi publik', 150, 23),
(105, 'CPL-7', 'P3. Menguasai metode penelitian kualitatif dan kuantitatif, minimal metode survei, penelitian lapangan, studi kasus, studi dokumen, dan penelitian\r\nkebijakan.', 151, 23),
(106, 'CPL-8', 'P4. Menguasai prinsip-prinsip dan teknik komunikasi persuasif, baik lisan maupun tulisan.', 152, 23),
(107, 'CPL-9', 'KU1. Mampu menerapkan pamikiran logis, kritis, sistematis, dan inovatif dalam konteks implementasi ilmu pengetahuan dan teknologi serta mampu\r\nmenunjukan kinerja madiri yang berkualitas sesuai dengan bidang keahliannya berdasarkan kaidah tata cara dan etika ilmiah.', 132, 23),
(108, 'CPL-10', 'KU2. Mampu menyelesaikan masalah dibidang keahliannya dan disusun dalam deskripsi saintifik sebagai hasil kajian dalam bentuk skripsi atau laporan tugas\r\nakhir berdasarkan hasil analisis terhadap informasi dan data yang menghasilkan solusi atau gagasan ilmiah', 133, 23),
(109, 'CPL-11', 'KU3. Mampu memelihara dan mengembangkan jaringan kerja dengan kolega, sejawat baik di dalam maupun di luar lembaganya serta mampu\r\nbertanggungjawab atas pencapaian kinerja serta melakukan proses evaluasi terhadap tugas kelompok kerja yang berada dibawah tanggungjawabnya.', 134, 23),
(110, 'CPL-12', '\r\nKU4. Mampu mendokumentasikan, menyimpan, mengamankan, dan menjamin kesahihan serta mencegah plagiasi', 135, 23),
(111, 'CPL-13', 'KK1. Menerapkan pemikiran logis, kritis, sistematis dan inovatif dalam konteks pengembangan atau implementasi ilmu pengetahuan dan teknologi yang pemperhatikan dan menerapkan nilai humaniora yang sesuai dengan bidang\r\nkeahliannya.', 140, 23),
(112, 'CPL-14', '\r\nKK2. Mampu mengindentifikasi dan menganalisis interaksi antar aktor dalam\r\npenerapan manajemen pelayanan publik, baik di tingkat lokal maupun nasional', 141, 23),
(113, 'CPL-15', '\r\nKK3. Mampu menganalisis dan mengevaluasi kebijakan publik dengan menggunakan prinsip-prinsip, metode kuantitatif (a.l. cost benefit analysis, analytical hierarchy process) dan metode kualitatif (a.l. participatory impact analysis, studi kasus) dalam seluruh siklus kebijakan (formulasi, implementasi,\r\ndan evaluasi.', 142, 23),
(114, 'CPL-16', '\r\nKK4. Mampu mengkaji regulasi yang relevan dan hasil analisis kebijakan yang berupa catatan kebijakan (policy memo), uraian kebijakan (policy brief), atau\r\nkertas kerja kebijakan (policy paper) untuk menghasilkan draf kebijakan.', 143, 23),
(115, 'CPL-17', '\r\nKK5. Mampu mengorganisasikan (merencanakan, menyusun anggaran, mengalokasikan sumber daya, implementasi dan evaluasi) kegiatan dalam rangka implementasi kebijakan publik dan peningkatan kinerja pelayanan\r\npublik.', 144, 23);
